            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><table class=\"c6\">\n<tbody><tr>\n<td><$link class=\"pginternal\" to=\"$:/plugins/twpub/94ae074fcdaa7fab/text/000000023\">ACT I.</$link></td>\n</tr>\n<tr>\n<td><$link class=\"pginternal\" to=\"$:/plugins/twpub/94ae074fcdaa7fab/text/000001008\">ACT II.</$link></td>\n</tr>\n<tr>\n<td><$link class=\"pginternal\" to=\"$:/plugins/twpub/94ae074fcdaa7fab/text/000001877\">ACT III.</$link></td>\n</tr>\n</tbody></table></div>"
