            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><h3>DRAMATIS PERSONAE</h3></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000017": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000017",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><p class=\"noindent\">Torvald Helmer.<br>\nNora, his wife.<br>\nDoctor Rank.<br>\nMrs Linde.<br>\nNils Krogstad.<br>\nHelmer’s three young children.<br>\nAnne, their nurse.<br>\nA Housemaid.<br>\nA Porter.<br>\n<br>\n<i>[The action takes place in Helmer’s house.]</i></p></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000018": {
