            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><h2>A DOLL’S HOUSE</h2></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000021": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000021",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000022": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000022",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000023": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000023",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><h2><a></a>ACT I</h2></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000024": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000024",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000025": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000025",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[SCENE.—A room furnished comfortably and tastefully, but not extravagantly. At the back, a door to the right leads to the entrance-hall, another to the left leads to Helmer’s study. Between the doors stands a piano. In the middle of the left-hand wall is a door, and beyond it a window. Near the window are a round table, arm-chairs and a small sofa. In the right-hand wall, at the farther end, another door; and on the same side, nearer the footlights, a stove, two easy chairs and a rocking-chair; between the stove and the door, a small table. Engravings on the walls; a cabinet with china and other small objects; a small book-case with well-bound books. The floors are carpeted, and a fire burns in the stove. It is winter.</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000026": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000026",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000027": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000027",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>A bell rings in the hall; shortly afterwards the door is heard to open. Enter NORA, humming a tune and in high spirits. She is in outdoor dress and carries a number of parcels; these she lays on the table to the right. She leaves the outer door open after her, and through it is seen a PORTER who is carrying a Christmas Tree and a basket, which he gives to the MAID who has opened the door.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000028": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000028",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000029": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000029",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHide the Christmas Tree carefully, Helen. Be sure the children do not see it until this evening, when it is dressed. <i>[To the PORTER, taking out her purse.]</i> How much?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000030": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000030",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000031": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000031",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">PORTER.<br>\nSixpence.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000032": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000032",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000033": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000033",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThere is a shilling. No, keep the change. <i>[The PORTER thanks her, and goes out. NORA shuts the door. She is laughing to herself, as she takes off her hat and coat. She takes a packet of macaroons from her pocket and eats one or two; then goes cautiously to her husband’s door and listens.]</i> Yes, he is in. <i>[Still humming, she goes to the table on the right.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000034": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000034",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000035": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000035",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[calls out from his room]</i>. Is that my little lark twittering out there?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000036": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000036",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000037": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000037",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[busy opening some of the parcels]</i>. Yes, it is!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000038": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000038",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000039": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000039",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nIs it my little squirrel bustling about?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000040": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000040",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000041": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000041",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000042": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000042",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000043": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000043",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhen did my squirrel come home?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000044": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000044",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000045": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000045",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nJust now. <i>[Puts the bag of macaroons into her pocket and wipes her mouth.]</i> Come in here, Torvald, and see what I have bought.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000046": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000046",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000047": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000047",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nDon’t disturb me. <i>[A little later, he opens the door and looks into the room, pen in hand.]</i> Bought, did you say? All these things? Has my little spendthrift been wasting money again?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000048": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000048",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000049": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000049",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes but, Torvald, this year we really can let ourselves go a little. This is the first Christmas that we have not needed to economise.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000050": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000050",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000051": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000051",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nStill, you know, we can’t spend money recklessly.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000052": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000052",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000053": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000053",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, Torvald, we may be a wee bit more reckless now, mayn’t we? Just a tiny wee bit! You are going to have a big salary and earn lots and lots of money.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000054": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000054",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000055": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000055",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes, after the New Year; but then it will be a whole quarter before the salary is due.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000056": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000056",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000057": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000057",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nPooh! we can borrow until then.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000058": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000058",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000059": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000059",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora! <i>[Goes up to her and takes her playfully by the ear.]</i> The same little featherhead! Suppose, now, that I borrowed fifty pounds today, and you spent it all in the Christmas week, and then on New Year’s Eve a slate fell on my head and killed me, and—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000060": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000060",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000061": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000061",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[putting her hands over his mouth]</i>. Oh! don’t say such horrid things.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000062": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000062",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000063": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000063",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nStill, suppose that happened,—what then?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000064": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000064",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000065": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000065",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIf that were to happen, I don’t suppose I should care whether I owed money or not.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000066": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000066",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000067": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000067",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes, but what about the people who had lent it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000068": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000068",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000069": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000069",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThey? Who would bother about them? I should not know who they were.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000070": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000070",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000071": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000071",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThat is like a woman! But seriously, Nora, you know what I think about that. No debt, no borrowing. There can be no freedom or beauty about a home life that depends on borrowing and debt. We two have kept bravely on the straight road so far, and we will go on the same way for the short time longer that there need be any struggle.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000072": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000072",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000073": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000073",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[moving towards the stove]</i>. As you please, Torvald.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000074": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000074",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000075": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000075",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[following her]</i>. Come, come, my little skylark must not droop her wings. What is this! Is my little squirrel out of temper? <i>[Taking out his purse.]</i> Nora, what do you think I have got here?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000076": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000076",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000077": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000077",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[turning round quickly]</i>. Money!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000078": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000078",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000079": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000079",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThere you are. <i>[Gives her some money.]</i> Do you think I don’t know what a lot is wanted for housekeeping at Christmas-time?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000080": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000080",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000081": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000081",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[counting]</i>. Ten shillings—a pound—two pounds! Thank you, thank you, Torvald; that will keep me going for a long time.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000082": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000082",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000083": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000083",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nIndeed it must.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000084": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000084",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000085": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000085",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, yes, it will. But come here and let me show you what I have bought. And all so cheap! Look, here is a new suit for Ivar, and a sword; and a horse and a trumpet for Bob; and a doll and dolly’s bedstead for Emmy,—they are very plain, but anyway she will soon break them in pieces. And here are dress-lengths and handkerchiefs for the maids; old Anne ought really to have something better.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000086": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000086",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000087": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000087",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd what is in this parcel?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000088": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000088",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000089": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000089",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[crying out]</i>. No, no! you mustn’t see that until this evening.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000090": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000090",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000091": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000091",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nVery well. But now tell me, you extravagant little person, what would you like for yourself?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000092": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000093": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000093",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nFor myself? Oh, I am sure I don’t want anything.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000094": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000094",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000095": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000095",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes, but you must. Tell me something reasonable that you would particularly like to have.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000096": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000096",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000097": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000097",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, I really can’t think of anything—unless, Torvald—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000098": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000098",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000099": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000099",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWell?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000100": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000100",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000101": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000101",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[playing with his coat buttons, and without raising her eyes to his]</i>. If you really want to give me something, you might—you might—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000102": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000102",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000103": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000103",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWell, out with it!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000104": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000104",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000105": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000105",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[speaking quickly]</i>. You might give me money, Torvald. Only just as much as you can afford; and then one of these days I will buy something with it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000106": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000106",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000107": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000107",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut, Nora—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000108": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000108",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000109": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOh, do! dear Torvald; please, please do! Then I will wrap it up in beautiful gilt paper and hang it on the Christmas Tree. Wouldn’t that be fun?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000110": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000110",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000111": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000111",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat are little people called that are always wasting money?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000112": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000113": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nSpendthrifts—I know. Let us do as you suggest, Torvald, and then I shall have time to think what I am most in want of. That is a very sensible plan, isn’t it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000114": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000114",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000115": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000115",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[smiling]</i>. Indeed it is—that is to say, if you were really to save out of the money I give you, and then really buy something for yourself. But if you spend it all on the housekeeping and any number of unnecessary things, then I merely have to pay up again.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000116": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000116",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000117": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000117",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOh but, Torvald—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000118": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000118",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000119": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000119",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou can’t deny it, my dear little Nora. <i>[Puts his arm round her waist.]</i> It’s a sweet little spendthrift, but she uses up a deal of money. One would hardly believe how expensive such little persons are!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000120": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000120",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000121": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000121",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt’s a shame to say that. I do really save all I can.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000122": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000122",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000123": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000123",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[laughing]</i>. That’s very true,—all you can. But you can’t save anything!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000124": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000124",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000125": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000125",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[smiling quietly and happily]</i>. You haven’t any idea how many expenses we skylarks and squirrels have, Torvald.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000126": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000126",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000127": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000127",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou are an odd little soul. Very like your father. You always find some new way of wheedling money out of me, and, as soon as you have got it, it seems to melt in your hands. You never know where it has gone. Still, one must take you as you are. It is in the blood; for indeed it is true that you can inherit these things, Nora.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000128": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000128",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000129": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000129",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAh, I wish I had inherited many of papa’s qualities.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000130": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000130",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000131": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000131",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd I would not wish you to be anything but just what you are, my sweet little skylark. But, do you know, it strikes me that you are looking rather—what shall I say—rather uneasy today?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000132": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000132",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000133": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000133",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDo I?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000134": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000134",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000135": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000135",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou do, really. Look straight at me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000136": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000136",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000137": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000137",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[looks at him]</i>. Well?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000138": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000138",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000139": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000139",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[wagging his finger at her]</i>. Hasn’t Miss Sweet Tooth been breaking rules in town today?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000140": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000140",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000141": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000141",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo; what makes you think that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000142": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000142",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000143": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000143",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nHasn’t she paid a visit to the confectioner’s?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000144": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000144",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000145": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000145",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, I assure you, Torvald—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000146": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000146",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000147": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000147",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNot been nibbling sweets?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000148": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000148",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000149": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000149",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, certainly not.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000150": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000150",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000151": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000151",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNot even taken a bite at a macaroon or two?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000152": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000152",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000153": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000153",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, Torvald, I assure you really—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000154": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000154",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000155": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000155",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThere, there, of course I was only joking.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000156": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000156",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000157": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000157",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[going to the table on the right]</i>. I should not think of going against your wishes.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000158": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000158",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000159": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000159",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNo, I am sure of that; besides, you gave me your word— <i>[Going up to her.]</i> Keep your little Christmas secrets to yourself, my darling. They will all be revealed tonight when the Christmas Tree is lit, no doubt.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000160": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000160",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000161": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000161",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDid you remember to invite Doctor Rank?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000162": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000162",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000163": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000163",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNo. But there is no need; as a matter of course he will come to dinner with us. However, I will ask him when he comes in this morning. I have ordered some good wine. Nora, you can’t think how I am looking forward to this evening.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000164": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000164",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000165": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000165",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nSo am I! And how the children will enjoy themselves, Torvald!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000166": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000166",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000167": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000167",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nIt is splendid to feel that one has a perfectly safe appointment, and a big enough income. It’s delightful to think of, isn’t it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000168": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000168",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000169": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000169",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt’s wonderful!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000170": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000170",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000171": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000171",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nDo you remember last Christmas? For a full three weeks beforehand you shut yourself up every evening until long after midnight, making ornaments for the Christmas Tree, and all the other fine things that were to be a surprise to us. It was the dullest three weeks I ever spent!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000172": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000172",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000173": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000173",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI didn’t find it dull.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000174": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000174",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000175": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000175",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[smiling]</i>. But there was precious little result, Nora.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000176": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000176",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000177": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000177",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOh, you shouldn’t tease me about that again. How could I help the cat’s going in and tearing everything to pieces?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000178": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000178",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000179": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000179",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nOf course you couldn’t, poor little girl. You had the best of intentions to please us all, and that’s the main thing. But it is a good thing that our hard times are over.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000180": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000180",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000181": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000181",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, it is really wonderful.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000182": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000182",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000183": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000183",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThis time I needn’t sit here and be dull all alone, and you needn’t ruin your dear eyes and your pretty little hands—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000184": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000184",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000185": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000185",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[clapping her hands]</i>. No, Torvald, I needn’t any longer, need I! It’s wonderfully lovely to hear you say so! <i>[Taking his arm.]</i> Now I will tell you how I have been thinking we ought to arrange things, Torvald. As soon as Christmas is over—<i>[A bell rings in the hall.]</i> There’s the bell. <i>[She tidies the room a little.]</i> There’s some one at the door. What a nuisance!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000186": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000186",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000187": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000187",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nIf it is a caller, remember I am not at home.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000188": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000188",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000189": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000189",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\n<i>[in the doorway]</i>. A lady to see you, ma’am,—a stranger.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000190": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000190",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000191": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000191",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAsk her to come in.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000192": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000192",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000193": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000193",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\n<i>[to HELMER]</i>. The doctor came at the same time, sir.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000194": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000194",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000195": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000195",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nDid he go straight into my room?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000196": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000196",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000197": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000197",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\nYes, sir.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000198": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000198",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000199": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000199",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[HELMER goes into his room. The MAID ushers in Mrs Linde, who is in travelling dress, and shuts the door.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000200": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000200",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000201": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000201",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[in a dejected and timid voice]</i>. How do you do, Nora?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000202": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000202",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000203": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000203",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[doubtfully]</i>. How do you do—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000204": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000204",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000205": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000205",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYou don’t recognise me, I suppose.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000206": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000206",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000207": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000207",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, I don’t know—yes, to be sure, I seem to—<i>[Suddenly.]</i> Yes! Christine! Is it really you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000208": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000208",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000209": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000209",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, it is I.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000210": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000210",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000211": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000211",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nChristine! To think of my not recognising you! And yet how could I—<i>[In a gentle voice.]</i> How you have altered, Christine!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000212": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000212",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000213": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000213",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, I have indeed. In nine, ten long years—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000214": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000214",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000215": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000215",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIs it so long since we met? I suppose it is. The last eight years have been a happy time for me, I can tell you. And so now you have come into the town, and have taken this long journey in winter—that was plucky of you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000216": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000216",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000217": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000217",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI arrived by steamer this morning.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000218": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000218",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000219": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000219",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nTo have some fun at Christmas-time, of course. How delightful! We will have such fun together! But take off your things. You are not cold, I hope. <i>[Helps her.]</i> Now we will sit down by the stove, and be cosy. No, take this armchair; I will sit here in the rocking-chair. <i>[Takes her hands.]</i> Now you look like your old self again; it was only the first moment—You are a little paler, Christine, and perhaps a little thinner.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000220": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000220",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000221": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000221",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nAnd much, much older, Nora.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000222": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000222",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000223": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000223",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nPerhaps a little older; very, very little; certainly not much. <i>[Stops suddenly and speaks seriously.]</i> What a thoughtless creature I am, chattering away like this. My poor, dear Christine, do forgive me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000224": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000224",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000225": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000225",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWhat do you mean, Nora?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000226": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000226",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000227": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000227",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[gently]</i>. Poor Christine, you are a widow.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000228": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000228",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000229": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000229",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes; it is three years ago now.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000230": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000230",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000231": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000231",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, I knew; I saw it in the papers. I assure you, Christine, I meant ever so often to write to you at the time, but I always put it off and something always prevented me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000232": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000232",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000233": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000233",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI quite understand, dear.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000234": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000234",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000235": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000235",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt was very bad of me, Christine. Poor thing, how you must have suffered. And he left you nothing?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000236": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000236",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000237": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000237",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000238": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000238",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000239": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000239",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd no children?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000240": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000240",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000241": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000241",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000242": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000242",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000243": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000243",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNothing at all, then.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000244": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000244",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000245": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000245",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNot even any sorrow or grief to live upon.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000246": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000246",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000247": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000247",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[looking incredulously at her]</i>. But, Christine, is that possible?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000248": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000248",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000249": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000249",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[smiles sadly and strokes her hair]</i>. It sometimes happens, Nora.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000250": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000250",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000251": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000251",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nSo you are quite alone. How dreadfully sad that must be. I have three lovely children. You can’t see them just now, for they are out with their nurse. But now you must tell me all about it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000252": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000252",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000253": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000253",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo, no; I want to hear about you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000254": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000254",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000255": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000255",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, you must begin. I mustn’t be selfish today; today I must only think of your affairs. But there is one thing I must tell you. Do you know we have just had a great piece of good luck?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000256": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000256",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000257": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000257",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo, what is it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000258": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000258",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000259": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000259",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nJust fancy, my husband has been made manager of the Bank!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000260": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000260",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000261": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000261",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYour husband? What good luck!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000262": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000262",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000263": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000263",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, tremendous! A barrister’s profession is such an uncertain thing, especially if he won’t undertake unsavoury cases; and naturally Torvald has never been willing to do that, and I quite agree with him. You may imagine how pleased we are! He is to take up his work in the Bank at the New Year, and then he will have a big salary and lots of commissions. For the future we can live quite differently—we can do just as we like. I feel so relieved and so happy, Christine! It will be splendid to have heaps of money and not need to have any anxiety, won’t it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000264": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000264",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000265": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000265",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, anyhow I think it would be delightful to have what one needs.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000266": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000266",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000267": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000267",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, not only what one needs, but heaps and heaps of money.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000268": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000268",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000269": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000269",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[smiling]</i>. Nora, Nora, haven’t you learned sense yet? In our schooldays you were a great spendthrift.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000270": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000270",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000271": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000271",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[laughing]</i>. Yes, that is what Torvald says now. <i>[Wags her finger at her.]</i> But “Nora, Nora” is not so silly as you think. We have not been in a position for me to waste money. We have both had to work.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000272": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000272",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000273": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000273",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYou too?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000274": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000274",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000275": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000275",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes; odds and ends, needlework, crotchet-work, embroidery, and that kind of thing. <i>[Dropping her voice.]</i> And other things as well. You know Torvald left his office when we were married? There was no prospect of promotion there, and he had to try and earn more than before. But during the first year he over-worked himself dreadfully. You see, he had to make money every way he could, and he worked early and late; but he couldn’t stand it, and fell dreadfully ill, and the doctors said it was necessary for him to go south.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000276": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000276",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000277": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000277",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYou spent a whole year in Italy, didn’t you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000278": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000278",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000279": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000279",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes. It was no easy matter to get away, I can tell you. It was just after Ivar was born; but naturally we had to go. It was a wonderfully beautiful journey, and it saved Torvald’s life. But it cost a tremendous lot of money, Christine.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000280": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000280",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000281": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000281",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nSo I should think.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000282": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000282",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000283": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000283",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt cost about two hundred and fifty pounds. That’s a lot, isn’t it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000284": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000284",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000285": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000285",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, and in emergencies like that it is lucky to have the money.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000286": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000286",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000287": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000287",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI ought to tell you that we had it from papa.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000288": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000288",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000289": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000289",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nOh, I see. It was just about that time that he died, wasn’t it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000290": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000290",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000291": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000291",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes; and, just think of it, I couldn’t go and nurse him. I was expecting little Ivar’s birth every day and I had my poor sick Torvald to look after. My dear, kind father—I never saw him again, Christine. That was the saddest time I have known since our marriage.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000292": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000292",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000293": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000293",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI know how fond you were of him. And then you went off to Italy?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000294": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000294",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000295": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000295",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes; you see we had money then, and the doctors insisted on our going, so we started a month later.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000296": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000296",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000297": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000297",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nAnd your husband came back quite well?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000298": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000298",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000299": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000299",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAs sound as a bell!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000300": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000300",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000301": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000301",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBut—the doctor?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000302": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000302",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000303": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000303",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat doctor?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000304": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000304",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000305": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000305",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI thought your maid said the gentleman who arrived here just as I did, was the doctor?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000306": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000306",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000307": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000307",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, that was Doctor Rank, but he doesn’t come here professionally. He is our greatest friend, and comes in at least once every day. No, Torvald has not had an hour’s illness since then, and our children are strong and healthy and so am I. <i>[Jumps up and claps her hands.]</i> Christine! Christine! it’s good to be alive and happy!—But how horrid of me; I am talking of nothing but my own affairs. <i>[Sits on a stool near her, and rests her arms on her knees.]</i> You mustn’t be angry with me. Tell me, is it really true that you did not love your husband? Why did you marry him?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000308": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000308",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000309": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000309",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nMy mother was alive then, and was bedridden and helpless, and I had to provide for my two younger brothers; so I did not think I was justified in refusing his offer.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000310": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000310",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000311": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000311",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, perhaps you were quite right. He was rich at that time, then?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000312": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000312",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000313": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000313",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI believe he was quite well off. But his business was a precarious one; and, when he died, it all went to pieces and there was nothing left.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000314": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000314",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000315": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000315",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd then?—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000316": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000316",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000317": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000317",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWell, I had to turn my hand to anything I could find—first a small shop, then a small school, and so on. The last three years have seemed like one long working-day, with no rest. Now it is at an end, Nora. My poor mother needs me no more, for she is gone; and the boys do not need me either; they have got situations and can shift for themselves.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000318": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000318",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000319": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000319",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat a relief you must feel if—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000320": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000320",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000321": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000321",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo, indeed; I only feel my life unspeakably empty. No one to live for anymore. <i>[Gets up restlessly.]</i> That was why I could not stand the life in my little backwater any longer. I hope it may be easier here to find something which will busy me and occupy my thoughts. If only I could have the good luck to get some regular work—office work of some kind—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000322": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000322",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000323": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000323",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBut, Christine, that is so frightfully tiring, and you look tired out now. You had far better go away to some watering-place.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000324": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000324",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000325": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000325",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[walking to the window]</i>. I have no father to give me money for a journey, Nora.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000326": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000326",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000327": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000327",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[rising]</i>. Oh, don’t be angry with me!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000328": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000328",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000329": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000329",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[going up to her]</i>. It is you that must not be angry with me, dear. The worst of a position like mine is that it makes one so bitter. No one to work for, and yet obliged to be always on the lookout for chances. One must live, and so one becomes selfish. When you told me of the happy turn your fortunes have taken—you will hardly believe it—I was delighted not so much on your account as on my own.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000330": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000330",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000331": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000331",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHow do you mean?—Oh, I understand. You mean that perhaps Torvald could get you something to do.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000332": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000332",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000333": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000333",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, that was what I was thinking of.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000334": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000334",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000335": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000335",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHe must, Christine. Just leave it to me; I will broach the subject very cleverly—I will think of something that will please him very much. It will make me so happy to be of some use to you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000336": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000336",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000337": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000337",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nHow kind you are, Nora, to be so anxious to help me! It is doubly kind in you, for you know so little of the burdens and troubles of life.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000338": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000338",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000339": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000339",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI—? I know so little of them?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000340": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000340",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000341": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000341",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[smiling]</i>. My dear! Small household cares and that sort of thing!—You are a child, Nora.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000342": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000342",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000343": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000343",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[tosses her head and crosses the stage]</i>. You ought not to be so superior.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000344": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000344",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000345": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000345",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000346": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000346",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000347": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000347",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou are just like the others. They all think that I am incapable of anything really serious—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000348": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000348",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000349": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000349",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nCome, come—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000350": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000350",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000351": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000351",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n—that I have gone through nothing in this world of cares.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000352": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000352",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000353": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000353",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBut, my dear Nora, you have just told me all your troubles.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000354": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000354",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000355": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000355",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nPooh!—those were trifles. <i>[Lowering her voice.]</i> I have not told you the important thing.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000356": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000356",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000357": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000357",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nThe important thing? What do you mean?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000358": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000358",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000359": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000359",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou look down upon me altogether, Christine—but you ought not to. You are proud, aren’t you, of having worked so hard and so long for your mother?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000360": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000360",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000361": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000361",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nIndeed, I don’t look down on anyone. But it is true that I am both proud and glad to think that I was privileged to make the end of my mother’s life almost free from care.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000362": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000362",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000363": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000363",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd you are proud to think of what you have done for your brothers?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000364": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000364",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000365": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000365",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI think I have the right to be.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000366": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000366",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000367": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000367",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI think so, too. But now, listen to this; I too have something to be proud and glad of.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000368": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000368",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000369": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000369",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI have no doubt you have. But what do you refer to?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000370": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000370",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000371": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000371",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nSpeak low. Suppose Torvald were to hear! He mustn’t on any account—no one in the world must know, Christine, except you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000372": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000372",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000373": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000373",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBut what is it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000374": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000374",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000375": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000375",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nCome here. <i>[Pulls her down on the sofa beside her.]</i> Now I will show you that I too have something to be proud and glad of. It was I who saved Torvald’s life.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000376": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000376",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000377": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000377",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n“Saved”? How?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000378": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000378",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000379": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000379",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI told you about our trip to Italy. Torvald would never have recovered if he had not gone there—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000380": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000380",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000381": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000381",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, but your father gave you the necessary funds.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000382": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000382",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000383": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000383",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[smiling]</i>. Yes, that is what Torvald and all the others think, but—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000384": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000384",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000385": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000385",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBut—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000386": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000386",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000387": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000387",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nPapa didn’t give us a shilling. It was I who procured the money.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000388": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000388",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000389": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000389",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYou? All that large sum?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000390": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000390",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000391": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000391",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nTwo hundred and fifty pounds. What do you think of that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000392": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000392",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000393": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000393",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBut, Nora, how could you possibly do it? Did you win a prize in the Lottery?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000394": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000394",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000395": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000395",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[contemptuously]</i>. In the Lottery? There would have been no credit in that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000396": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000396",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000397": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000397",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBut where did you get it from, then? Nora <i>[humming and smiling with an air of mystery]</i>. Hm, hm! Aha!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000398": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000398",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000399": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000399",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBecause you couldn’t have borrowed it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000400": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000400",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000401": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000401",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nCouldn’t I? Why not?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000402": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000402",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000403": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000403",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo, a wife cannot borrow without her husband’s consent.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000404": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000404",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000405": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000405",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[tossing her head]</i>. Oh, if it is a wife who has any head for business—a wife who has the wit to be a little bit clever—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000406": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000406",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000407": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000407",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI don’t understand it at all, Nora.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000408": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000408",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000409": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000409",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThere is no need you should. I never said I had borrowed the money. I may have got it some other way. <i>[Lies back on the sofa.]</i> Perhaps I got it from some other admirer. When anyone is as attractive as I am—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000410": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000410",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000411": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000411",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYou are a mad creature.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000412": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000412",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000413": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000413",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNow, you know you’re full of curiosity, Christine.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000414": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000414",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000415": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000415",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nListen to me, Nora dear. Haven’t you been a little bit imprudent?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000416": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000416",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000417": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000417",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[sits up straight]</i>. Is it imprudent to save your husband’s life?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000418": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000418",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000419": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000419",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nIt seems to me imprudent, without his knowledge, to—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000420": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000420",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000421": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000421",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBut it was absolutely necessary that he should not know! My goodness, can’t you understand that? It was necessary he should have no idea what a dangerous condition he was in. It was to me that the doctors came and said that his life was in danger, and that the only thing to save him was to live in the south. Do you suppose I didn’t try, first of all, to get what I wanted as if it were for myself? I told him how much I should love to travel abroad like other young wives; I tried tears and entreaties with him; I told him that he ought to remember the condition I was in, and that he ought to be kind and indulgent to me; I even hinted that he might raise a loan. That nearly made him angry, Christine. He said I was thoughtless, and that it was his duty as my husband not to indulge me in my whims and caprices—as I believe he called them. Very well, I thought, you must be saved—and that was how I came to devise a way out of the difficulty—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000422": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000422",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000423": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000423",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nAnd did your husband never get to know from your father that the money had not come from him?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000424": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000424",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000425": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000425",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, never. Papa died just at that time. I had meant to let him into the secret and beg him never to reveal it. But he was so ill then—alas, there never was any need to tell him.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000426": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000426",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000427": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000427",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nAnd since then have you never told your secret to your husband?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000428": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000428",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000429": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000429",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nGood Heavens, no! How could you think so? A man who has such strong opinions about these things! And besides, how painful and humiliating it would be for Torvald, with his manly independence, to know that he owed me anything! It would upset our mutual relations altogether; our beautiful happy home would no longer be what it is now.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000430": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000430",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000431": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000431",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nDo you mean never to tell him about it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000432": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000432",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000433": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000433",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[meditatively, and with a half smile]</i>. Yes—someday, perhaps, after many years, when I am no longer as nice-looking as I am now. Don’t laugh at me! I mean, of course, when Torvald is no longer as devoted to me as he is now; when my dancing and dressing-up and reciting have palled on him; then it may be a good thing to have something in reserve—<i>[Breaking off.]</i> What nonsense! That time will never come. Now, what do you think of my great secret, Christine? Do you still think I am of no use? I can tell you, too, that this affair has caused me a lot of worry. It has been by no means easy for me to meet my engagements punctually. I may tell you that there is something that is called, in business, quarterly interest, and another thing called payment in installments, and it is always so dreadfully difficult to manage them. I have had to save a little here and there, where I could, you understand. I have not been able to put aside much from my housekeeping money, for Torvald must have a good table. I couldn’t let my children be shabbily dressed; I have felt obliged to use up all he gave me for them, the sweet little darlings!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000434": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000434",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000435": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000435",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nSo it has all had to come out of your own necessaries of life, poor Nora?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000436": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000436",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000437": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000437",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOf course. Besides, I was the one responsible for it. Whenever Torvald has given me money for new dresses and such things, I have never spent more than half of it; I have always bought the simplest and cheapest things. Thank Heaven, any clothes look well on me, and so Torvald has never noticed it. But it was often very hard on me, Christine—because it is delightful to be really well dressed, isn’t it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000438": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000438",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000439": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000439",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nQuite so.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000440": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000440",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000441": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000441",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWell, then I have found other ways of earning money. Last winter I was lucky enough to get a lot of copying to do; so I locked myself up and sat writing every evening until quite late at night. Many a time I was desperately tired; but all the same it was a tremendous pleasure to sit there working and earning money. It was like being a man.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000442": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000442",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000443": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000443",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nHow much have you been able to pay off in that way?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000444": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000444",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000445": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000445",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI can’t tell you exactly. You see, it is very difficult to keep an account of a business matter of that kind. I only know that I have paid every penny that I could scrape together. Many a time I was at my wits’ end. <i>[Smiles.]</i> Then I used to sit here and imagine that a rich old gentleman had fallen in love with me—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000446": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000446",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000447": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000447",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWhat! Who was it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000448": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000448",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000449": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000449",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBe quiet!—that he had died; and that when his will was opened it contained, written in big letters, the instruction: “The lovely Mrs Nora Helmer is to have all I possess paid over to her at once in cash.”</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000450": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000450",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000451": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000451",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBut, my dear Nora—who could the man be?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000452": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000452",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000453": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000453",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nGood gracious, can’t you understand? There was no old gentleman at all; it was only something that I used to sit here and imagine, when I couldn’t think of any way of procuring money. But it’s all the same now; the tiresome old person can stay where he is, as far as I am concerned; I don’t care about him or his will either, for I am free from care now. <i>[Jumps up.]</i> My goodness, it’s delightful to think of, Christine! Free from care! To be able to be free from care, quite free from care; to be able to play and romp with the children; to be able to keep the house beautifully and have everything just as Torvald likes it! And, think of it, soon the spring will come and the big blue sky! Perhaps we shall be able to take a little trip—perhaps I shall see the sea again! Oh, it’s a wonderful thing to be alive and be happy. <i>[A bell is heard in the hall.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000454": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000454",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000455": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000455",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[rising]</i>. There is the bell; perhaps I had better go.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000456": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000456",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000457": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000457",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, don’t go; no one will come in here; it is sure to be for Torvald.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000458": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000458",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000459": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000459",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">SERVANT.<br>\n<i>[at the hall door]</i>. Excuse me, ma’am—there is a gentleman to see the master, and as the doctor is with him—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000460": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000460",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000461": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000461",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWho is it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000462": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000462",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000463": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000463",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\n<i>[at the door]</i>. It is I, Mrs Helmer. <i>[Mrs LINDE starts, trembles, and turns to the window.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000464": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000464",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000465": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000465",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[takes a step towards him, and speaks in a strained, low voice]</i>. You? What is it? What do you want to see my husband about?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000466": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000466",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000467": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000467",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nBank business—in a way. I have a small post in the Bank, and I hear your husband is to be our chief now—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000468": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000468",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000469": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000469",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThen it is—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000470": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000470",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000471": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000471",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nNothing but dry business matters, Mrs Helmer; absolutely nothing else.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000472": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000472",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000473": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000473",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBe so good as to go into the study, then. <i>[She bows indifferently to him and shuts the door into the hall; then comes back and makes up the fire in the stove.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000474": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000474",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000475": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000475",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNora—who was that man?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000476": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000476",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000477": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000477",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nA lawyer, of the name of Krogstad.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000478": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000478",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000479": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000479",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nThen it really was he.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000480": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000480",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000481": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000481",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDo you know the man?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000482": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000482",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000483": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000483",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI used to—many years ago. At one time he was a solicitor’s clerk in our town.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000484": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000484",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000485": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000485",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, he was.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000486": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000486",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000487": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000487",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nHe is greatly altered.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000488": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000488",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000489": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000489",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHe made a very unhappy marriage.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000490": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000490",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000491": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000491",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nHe is a widower now, isn’t he?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000492": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000492",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000493": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000493",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWith several children. There now, it is burning up. [Shuts the door of the stove and moves the rocking-chair aside.]</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000494": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000494",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000495": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000495",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nThey say he carries on various kinds of business.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000496": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000496",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000497": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000497",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nReally! Perhaps he does; I don’t know anything about it. But don’t let us think of business; it is so tiresome.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000498": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000498",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000499": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000499",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">DOCTOR RANK.<br>\n<i>[comes out of HELMER’S study. Before he shuts the door he calls to him]</i>. No, my dear fellow, I won’t disturb you; I would rather go in to your wife for a little while. <i>[Shuts the door and sees Mrs LINDE.]</i> I beg your pardon; I am afraid I am disturbing you too.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000500": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000500",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000501": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000501",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, not at all. <i>[Introducing him]</i>. Doctor Rank, Mrs Linde.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000502": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000502",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000503": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000503",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nI have often heard Mrs Linde’s name mentioned here. I think I passed you on the stairs when I arrived, Mrs Linde?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000504": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000504",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000505": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000505",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, I go up very slowly; I can’t manage stairs well.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000506": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000506",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000507": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000507",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nAh! some slight internal weakness?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000508": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000508",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000509": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000509",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo, the fact is I have been overworking myself.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000510": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000510",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000511": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000511",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nNothing more than that? Then I suppose you have come to town to amuse yourself with our entertainments?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000512": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000512",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000513": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000513",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI have come to look for work.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000514": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000514",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000515": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000515",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nIs that a good cure for overwork?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000516": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000516",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000517": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000517",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nOne must live, Doctor Rank.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000518": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000518",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000519": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000519",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nYes, the general opinion seems to be that it is necessary.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000520": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000520",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000521": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000521",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nLook here, Doctor Rank—you know you want to live.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000522": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000522",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000523": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000523",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nCertainly. However wretched I may feel, I want to prolong the agony as long as possible. All my patients are like that. And so are those who are morally diseased; one of them, and a bad case too, is at this very moment with Helmer—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000524": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000524",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000525": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000525",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[sadly]</i>. Ah!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000526": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000526",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000527": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000527",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhom do you mean?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000528": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000528",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000529": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000529",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nA lawyer of the name of Krogstad, a fellow you don’t know at all. He suffers from a diseased moral character, Mrs Helmer; but even he began talking of its being highly important that he should live.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000530": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000530",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000531": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000531",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDid he? What did he want to speak to Torvald about?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000532": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000532",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000533": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000533",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nI have no idea; I only heard that it was something about the Bank.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000534": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000534",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000535": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000535",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI didn’t know this—what’s his name—Krogstad had anything to do with the Bank.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000536": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000536",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000537": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000537",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nYes, he has some sort of appointment there. <i>[To Mrs Linde.]</i> I don’t know whether you find also in your part of the world that there are certain people who go zealously snuffing about to smell out moral corruption, and, as soon as they have found some, put the person concerned into some lucrative position where they can keep their eye on him. Healthy natures are left out in the cold.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000538": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000538",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000539": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000539",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nStill I think the sick are those who most need taking care of.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000540": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000540",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000541": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000541",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[shrugging his shoulders]</i>. Yes, there you are. That is the sentiment that is turning Society into a sick-house.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000542": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000542",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000543": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000543",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[NORA, who has been absorbed in her thoughts, breaks out into smothered laughter and claps her hands.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000544": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000544",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000545": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000545",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWhy do you laugh at that? Have you any notion what Society really is?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000546": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000546",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000547": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000547",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat do I care about tiresome Society? I am laughing at something quite different, something extremely amusing. Tell me, Doctor Rank, are all the people who are employed in the Bank dependent on Torvald now?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000548": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000548",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000549": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000549",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nIs that what you find so extremely amusing?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000550": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000550",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000551": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000551",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[smiling and humming]</i>. That’s my affair! <i>[Walking about the room.]</i> It’s perfectly glorious to think that we have—that Torvald has so much power over so many people. <i>[Takes the packet from her pocket.]</i> Doctor Rank, what do you say to a macaroon?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000552": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000552",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000553": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000553",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWhat, macaroons? I thought they were forbidden here.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000554": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000554",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000555": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000555",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, but these are some Christine gave me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000556": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000556",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000557": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000557",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWhat! I?—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000558": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000558",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000559": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000559",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOh, well, don’t be alarmed! You couldn’t know that Torvald had forbidden them. I must tell you that he is afraid they will spoil my teeth. But, bah!—once in a way—That’s so, isn’t it, Doctor Rank? By your leave! <i>[Puts a macaroon into his mouth.]</i> You must have one too, Christine. And I shall have one, just a little one—or at most two. <i>[Walking about.]</i> I am tremendously happy. There is just one thing in the world now that I should dearly love to do.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000560": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000560",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000561": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000561",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWell, what is that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000562": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000562",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000563": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000563",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt’s something I should dearly love to say, if Torvald could hear me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000564": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000564",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000565": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000565",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWell, why can’t you say it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000566": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000566",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000567": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000567",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, I daren’t; it’s so shocking.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000568": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000568",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000569": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000569",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nShocking?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000570": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000570",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000571": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000571",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWell, I should not advise you to say it. Still, with us you might. What is it you would so much like to say if Torvald could hear you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000572": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000572",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000573": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000573",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI should just love to say—Well, I’m damned!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000574": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000574",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000575": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000575",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nAre you mad?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000576": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000576",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000577": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000577",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNora, dear—!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000578": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000578",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000579": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000579",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nSay it, here he is!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000580": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000580",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000581": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000581",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[hiding the packet]</i>. Hush! Hush! Hush! <i>[HELMER comes out of his room, with his coat over his arm and his hat in his hand.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000582": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000582",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000583": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000583",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWell, Torvald dear, have you got rid of him?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000584": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000584",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000585": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000585",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes, he has just gone.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000586": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000586",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000587": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000587",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nLet me introduce you—this is Christine, who has come to town.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000588": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000588",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000589": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000589",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nChristine—? Excuse me, but I don’t know—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000590": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000590",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000591": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000591",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nMrs Linde, dear; Christine Linde.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000592": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000592",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000593": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000593",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nOf course. A school friend of my wife’s, I presume?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000594": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000594",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000595": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000595",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, we have known each other since then.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000596": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000596",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000597": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000597",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd just think, she has taken a long journey in order to see you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000598": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000598",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000599": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000599",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat do you mean?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000600": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000600",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000601": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000601",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo, really, I—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000602": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000602",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000603": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000603",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nChristine is tremendously clever at book-keeping, and she is frightfully anxious to work under some clever man, so as to perfect herself—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000604": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000604",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000605": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000605",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nVery sensible, Mrs Linde.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000606": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000606",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000607": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000607",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd when she heard you had been appointed manager of the Bank—the news was telegraphed, you know—she travelled here as quick as she could. Torvald, I am sure you will be able to do something for Christine, for my sake, won’t you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000608": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000608",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000609": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000609",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWell, it is not altogether impossible. I presume you are a widow, Mrs Linde?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000610": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000610",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000611": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000611",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000612": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000612",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000613": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000613",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd have had some experience of book-keeping?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000614": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000614",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000615": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000615",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, a fair amount.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000616": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000616",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000617": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000617",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAh! well, it’s very likely I may be able to find something for you—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000618": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000618",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000619": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000619",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[clapping her hands]</i>. What did I tell you? What did I tell you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000620": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000620",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000621": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000621",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou have just come at a fortunate moment, Mrs Linde.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000622": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000622",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000623": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000623",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nHow am I to thank you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000624": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000624",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000625": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000625",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThere is no need. <i>[Puts on his coat.]</i> But today you must excuse me—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000626": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000626",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000627": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000627",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWait a minute; I will come with you. <i>[Brings his fur coat from the hall and warms it at the fire.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000628": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000628",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000629": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000629",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDon’t be long away, Torvald dear.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000630": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000630",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000631": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000631",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAbout an hour, not more.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000632": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000632",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000633": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000633",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAre you going too, Christine?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000634": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000634",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000635": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000635",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[putting on her cloak]</i>. Yes, I must go and look for a room.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000636": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000636",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000637": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000637",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nOh, well then, we can walk down the street together.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000638": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000638",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000639": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000639",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[helping her]</i>. What a pity it is we are so short of space here; I am afraid it is impossible for us—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000640": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000640",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000641": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000641",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nPlease don’t think of it! Goodbye, Nora dear, and many thanks.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000642": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000642",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000643": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000643",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nGoodbye for the present. Of course you will come back this evening. And you too, Dr. Rank. What do you say? If you are well enough? Oh, you must be! Wrap yourself up well. <i>[They go to the door all talking together. Children’s voices are heard on the staircase.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000644": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000644",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000645": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000645",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThere they are! There they are! <i>[She runs to open the door. The NURSE comes in with the children.]</i> Come in! Come in! <i>[Stoops and kisses them.]</i> Oh, you sweet blessings! Look at them, Christine! Aren’t they darlings?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000646": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000646",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000647": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000647",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nDon’t let us stand here in the draught.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000648": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000648",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000649": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000649",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nCome along, Mrs Linde; the place will only be bearable for a mother now!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000650": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000650",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000651": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000651",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[RANK, HELMER, and Mrs Linde go downstairs. The NURSE comes forward with the children; NORA shuts the hall door.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000652": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000652",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000653": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000653",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHow fresh and well you look! Such red cheeks like apples and roses. <i>[The children all talk at once while she speaks to them.]</i> Have you had great fun? That’s splendid! What, you pulled both Emmy and Bob along on the sledge? —both at once?—that was good. You are a clever boy, Ivar. Let me take her for a little, Anne. My sweet little baby doll! <i>[Takes the baby from the MAID and dances it up and down.]</i> Yes, yes, mother will dance with Bob too. What! Have you been snowballing? I wish I had been there too! No, no, I will take their things off, Anne; please let me do it, it is such fun. Go in now, you look half frozen. There is some hot coffee for you on the stove.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000654": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000654",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000655": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000655",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[The NURSE goes into the room on the left. NORA takes off the children’s things and throws them about, while they all talk to her at once.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000656": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000656",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000657": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000657",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nReally! Did a big dog run after you? But it didn’t bite you? No, dogs don’t bite nice little dolly children. You mustn’t look at the parcels, Ivar. What are they? Ah, I daresay you would like to know. No, no—it’s something nasty! Come, let us have a game! What shall we play at? Hide and Seek? Yes, we’ll play Hide and Seek. Bob shall hide first. Must I hide? Very well, I’ll hide first. <i>[She and the children laugh and shout, and romp in and out of the room; at last NORA hides under the table, the children rush in and out for her, but do not see her; they hear her smothered laughter, run to the table, lift up the cloth and find her. Shouts of laughter. She crawls forward and pretends to frighten them. Fresh laughter. Meanwhile there has been a knock at the hall door, but none of them has noticed it. The door is half opened, and KROGSTAD appears, he waits a little; the game goes on.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000658": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000658",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000659": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000659",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nExcuse me, Mrs Helmer.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000660": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000660",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000661": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000661",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[with a stifled cry, turns round and gets up on to her knees]</i>. Ah! what do you want?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000662": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000662",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000663": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000663",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nExcuse me, the outer door was ajar; I suppose someone forgot to shut it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000664": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000664",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000665": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000665",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[rising]</i>. My husband is out, Mr. Krogstad.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000666": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000666",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000667": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000667",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI know that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000668": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000668",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000669": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000669",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat do you want here, then?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000670": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000670",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000671": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000671",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nA word with you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000672": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000672",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000673": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000673",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWith me?—<i>[To the children, gently.]</i> Go in to nurse. What? No, the strange man won’t do mother any harm. When he has gone we will have another game. <i>[She takes the children into the room on the left, and shuts the door after them.]</i> You want to speak to me?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000674": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000674",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000675": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000675",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nYes, I do.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000676": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000676",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000677": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000677",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nToday? It is not the first of the month yet.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000678": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000678",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000679": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000679",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nNo, it is Christmas Eve, and it will depend on yourself what sort of a Christmas you will spend.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000680": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000680",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000681": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000681",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat do you mean? Today it is absolutely impossible for me—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000682": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000682",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000683": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000683",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nWe won’t talk about that until later on. This is something different. I presume you can give me a moment?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000684": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000684",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000685": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000685",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes—yes, I can—although—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000686": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000686",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000687": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000687",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nGood. I was in Olsen’s Restaurant and saw your husband going down the street—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000688": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000688",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000689": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000689",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000690": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000690",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000691": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000691",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nWith a lady.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000692": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000692",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000693": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000693",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat then?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000694": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000694",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000695": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000695",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nMay I make so bold as to ask if it was a Mrs Linde?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000696": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000696",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000697": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000697",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt was.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000698": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000698",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000699": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000699",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nJust arrived in town?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000700": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000700",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000701": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000701",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, today.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000702": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000702",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000703": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000703",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nShe is a great friend of yours, isn’t she?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000704": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000704",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000705": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000705",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nShe is. But I don’t see—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000706": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000706",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000707": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000707",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI knew her too, once upon a time.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000708": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000708",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000709": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000709",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI am aware of that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000710": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000710",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000711": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000711",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nAre you? So you know all about it; I thought as much. Then I can ask you, without beating about the bush—is Mrs Linde to have an appointment in the Bank?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000712": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000712",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000713": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000713",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat right have you to question me, Mr. Krogstad?—You, one of my husband’s subordinates! But since you ask, you shall know. Yes, Mrs Linde is to have an appointment. And it was I who pleaded her cause, Mr. Krogstad, let me tell you that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000714": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000714",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000715": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000715",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI was right in what I thought, then.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000716": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000716",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000717": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000717",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[walking up and down the stage]</i>. Sometimes one has a tiny little bit of influence, I should hope. Because one is a woman, it does not necessarily follow that—. When anyone is in a subordinate position, Mr. Krogstad, they should really be careful to avoid offending anyone who—who—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000718": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000718",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000719": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000719",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nWho has influence?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000720": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000720",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000721": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000721",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nExactly.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000722": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000722",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000723": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000723",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\n<i>[changing his tone]</i>. Mrs Helmer, you will be so good as to use your influence on my behalf.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000724": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000724",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000725": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000725",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat? What do you mean?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000726": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000726",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000727": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000727",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nYou will be so kind as to see that I am allowed to keep my subordinate position in the Bank.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000728": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000728",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000729": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000729",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat do you mean by that? Who proposes to take your post away from you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000730": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000730",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000731": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000731",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nOh, there is no necessity to keep up the pretence of ignorance. I can quite understand that your friend is not very anxious to expose herself to the chance of rubbing shoulders with me; and I quite understand, too, whom I have to thank for being turned off.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000732": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000732",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000733": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000733",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBut I assure you—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000734": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000734",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000735": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000735",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nVery likely; but, to come to the point, the time has come when I should advise you to use your influence to prevent that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000736": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000736",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000737": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000737",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBut, Mr. Krogstad, I have no influence.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000738": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000738",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000739": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000739",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nHaven’t you? I thought you said yourself just now—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000740": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000740",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000741": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000741",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNaturally I did not mean you to put that construction on it. I! What should make you think I have any influence of that kind with my husband?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000742": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000742",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000743": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000743",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nOh, I have known your husband from our student days. I don’t suppose he is any more unassailable than other husbands.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000744": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000744",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000745": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000745",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIf you speak slightingly of my husband, I shall turn you out of the house.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000746": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000746",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000747": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000747",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nYou are bold, Mrs Helmer.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000748": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000748",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000749": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000749",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI am not afraid of you any longer. As soon as the New Year comes, I shall in a very short time be free of the whole thing.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000750": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000750",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000751": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000751",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\n<i>[controlling himself]</i>. Listen to me, Mrs Helmer. If necessary, I am prepared to fight for my small post in the Bank as if I were fighting for my life.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000752": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000752",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000753": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000753",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nSo it seems.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000754": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000754",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000755": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000755",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nIt is not only for the sake of the money; indeed, that weighs least with me in the matter. There is another reason—well, I may as well tell you. My position is this. I daresay you know, like everybody else, that once, many years ago, I was guilty of an indiscretion.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000756": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000756",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000757": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000757",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI think I have heard something of the kind.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000758": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000758",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000759": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000759",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nThe matter never came into court; but every way seemed to be closed to me after that. So I took to the business that you know of. I had to do something; and, honestly, I don’t think I’ve been one of the worst. But now I must cut myself free from all that. My sons are growing up; for their sake I must try and win back as much respect as I can in the town. This post in the Bank was like the first step up for me—and now your husband is going to kick me downstairs again into the mud.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000760": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000760",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000761": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000761",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBut you must believe me, Mr. Krogstad; it is not in my power to help you at all.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000762": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000762",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000763": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000763",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nThen it is because you haven’t the will; but I have means to compel you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000764": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000764",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000765": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000765",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou don’t mean that you will tell my husband that I owe you money?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000766": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000766",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000767": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000767",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nHm!—suppose I were to tell him?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000768": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000768",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000769": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000769",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt would be perfectly infamous of you. <i>[Sobbing.]</i> To think of his learning my secret, which has been my joy and pride, in such an ugly, clumsy way—that he should learn it from you! And it would put me in a horribly disagreeable position—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000770": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000770",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000771": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000771",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nOnly disagreeable?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000772": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000772",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000773": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000773",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[impetuously]</i>. Well, do it, then!—and it will be the worse for you. My husband will see for himself what a blackguard you are, and you certainly won’t keep your post then.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000774": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000774",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000775": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000775",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI asked you if it was only a disagreeable scene at home that you were afraid of?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000776": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000776",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000777": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000777",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIf my husband does get to know of it, of course he will at once pay you what is still owing, and we shall have nothing more to do with you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000778": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000778",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000779": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000779",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\n<i>[coming a step nearer]</i>. Listen to me, Mrs Helmer. Either you have a very bad memory or you know very little of business. I shall be obliged to remind you of a few details.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000780": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000780",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000781": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000781",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat do you mean?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000782": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000782",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000783": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000783",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nWhen your husband was ill, you came to me to borrow two hundred and fifty pounds.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000784": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000784",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000785": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000785",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI didn’t know anyone else to go to.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000786": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000786",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000787": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000787",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI promised to get you that amount—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000788": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000788",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000789": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000789",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, and you did so.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000790": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000790",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000791": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000791",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI promised to get you that amount, on certain conditions. Your mind was so taken up with your husband’s illness, and you were so anxious to get the money for your journey, that you seem to have paid no attention to the conditions of our bargain. Therefore it will not be amiss if I remind you of them. Now, I promised to get the money on the security of a bond which I drew up.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000792": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000792",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000793": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000793",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, and which I signed.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000794": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000794",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000795": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000795",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nGood. But below your signature there were a few lines constituting your father a surety for the money; those lines your father should have signed.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000796": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000796",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000797": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000797",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nShould? He did sign them.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000798": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000798",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000799": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000799",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI had left the date blank; that is to say, your father should himself have inserted the date on which he signed the paper. Do you remember that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000800": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000800",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000801": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000801",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, I think I remember—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000802": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000802",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000803": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000803",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nThen I gave you the bond to send by post to your father. Is that not so?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000804": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000804",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000805": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000805",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000806": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000806",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000807": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000807",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nAnd you naturally did so at once, because five or six days afterwards you brought me the bond with your father’s signature. And then I gave you the money.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000808": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000808",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000809": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000809",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWell, haven’t I been paying it off regularly?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000810": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000810",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000811": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000811",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nFairly so, yes. But—to come back to the matter in hand—that must have been a very trying time for you, Mrs Helmer?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000812": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000812",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000813": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000813",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt was, indeed.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000814": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000814",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000815": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000815",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nYour father was very ill, wasn’t he?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000816": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000816",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000817": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000817",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHe was very near his end.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000818": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000818",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000819": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000819",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nAnd died soon afterwards?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000820": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000820",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000821": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000821",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000822": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000822",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000823": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000823",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nTell me, Mrs Helmer, can you by any chance remember what day your father died?—on what day of the month, I mean.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000824": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000824",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000825": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000825",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nPapa died on the 29th of September.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000826": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000826",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000827": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000827",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nThat is correct; I have ascertained it for myself. And, as that is so, there is a discrepancy <i>[taking a paper from his pocket]</i> which I cannot account for.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000828": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000828",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000829": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000829",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat discrepancy? I don’t know—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000830": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000830",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000831": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000831",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nThe discrepancy consists, Mrs Helmer, in the fact that your father signed this bond three days after his death.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000832": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000832",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000833": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000833",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat do you mean? I don’t understand—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000834": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000834",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000835": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000835",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nYour father died on the 29th of September. But, look here; your father has dated his signature the 2nd of October. It is a discrepancy, isn’t it? <i>[NORA is silent.]</i> Can you explain it to me? <i>[NORA is still silent.]</i> It is a remarkable thing, too, that the words “2nd of October,” as well as the year, are not written in your father’s handwriting but in one that I think I know. Well, of course it can be explained; your father may have forgotten to date his signature, and someone else may have dated it haphazard before they knew of his death. There is no harm in that. It all depends on the signature of the name; and that is genuine, I suppose, Mrs Helmer? It was your father himself who signed his name here?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000836": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000836",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000837": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000837",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[after a short pause, throws her head up and looks defiantly at him]</i>. No, it was not. It was I that wrote papa’s name.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000838": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000838",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000839": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000839",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nAre you aware that is a dangerous confession?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000840": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000840",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000841": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000841",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIn what way? You shall have your money soon.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000842": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000842",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000843": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000843",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nLet me ask you a question; why did you not send the paper to your father?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000844": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000844",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000845": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000845",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt was impossible; papa was so ill. If I had asked him for his signature, I should have had to tell him what the money was to be used for; and when he was so ill himself I couldn’t tell him that my husband’s life was in danger—it was impossible.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000846": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000846",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000847": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000847",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nIt would have been better for you if you had given up your trip abroad.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000848": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000848",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000849": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000849",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, that was impossible. That trip was to save my husband’s life; I couldn’t give that up.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000850": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000850",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000851": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000851",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nBut did it never occur to you that you were committing a fraud on me?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000852": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000852",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000853": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000853",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI couldn’t take that into account; I didn’t trouble myself about you at all. I couldn’t bear you, because you put so many heartless difficulties in my way, although you knew what a dangerous condition my husband was in.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000854": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000854",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000855": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000855",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nMrs Helmer, you evidently do not realise clearly what it is that you have been guilty of. But I can assure you that my one false step, which lost me all my reputation, was nothing more or nothing worse than what you have done.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000856": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000856",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000857": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000857",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou? Do you ask me to believe that you were brave enough to run a risk to save your wife’s life?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000858": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000858",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000859": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000859",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nThe law cares nothing about motives.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000860": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000860",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000861": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000861",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThen it must be a very foolish law.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000862": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000862",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000863": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000863",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nFoolish or not, it is the law by which you will be judged, if I produce this paper in court.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000864": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000864",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000865": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000865",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI don’t believe it. Is a daughter not to be allowed to spare her dying father anxiety and care? Is a wife not to be allowed to save her husband’s life? I don’t know much about law; but I am certain that there must be laws permitting such things as that. Have you no knowledge of such laws—you who are a lawyer? You must be a very poor lawyer, Mr. Krogstad.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000866": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000866",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000867": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000867",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nMaybe. But matters of business—such business as you and I have had together—do you think I don’t understand that? Very well. Do as you please. But let me tell you this—if I lose my position a second time, you shall lose yours with me. <i>[He bows, and goes out through the hall.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000868": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000868",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000869": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000869",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[appears buried in thought for a short time, then tosses her head]</i>. Nonsense! Trying to frighten me like that!—I am not so silly as he thinks. <i>[Begins to busy herself putting the children’s things in order.]</i> And yet—? No, it’s impossible! I did it for love’s sake.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000870": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000870",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000871": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000871",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">THE CHILDREN.<br>\n<i>[in the doorway on the left]</i>. Mother, the stranger man has gone out through the gate.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000872": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000872",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000873": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000873",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, dears, I know. But, don’t tell anyone about the stranger man. Do you hear? Not even papa.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000874": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000874",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000875": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000875",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">CHILDREN.<br>\nNo, mother; but will you come and play again?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000876": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000876",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000877": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000877",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, no,—not now.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000878": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000878",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000879": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000879",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">CHILDREN.<br>\nBut, mother, you promised us.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000880": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000880",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000881": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000881",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, but I can’t now. Run away in; I have such a lot to do. Run away in, my sweet little darlings. <i>[She gets them into the room by degrees and shuts the door on them; then sits down on the sofa, takes up a piece of needlework and sews a few stitches, but soon stops.]</i> No! <i>[Throws down the work, gets up, goes to the hall door and calls out.]</i> Helen! bring the Tree in. <i>[Goes to the table on the left, opens a drawer, and stops again.]</i> No, no! it is quite impossible!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000882": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000882",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000883": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000883",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\n<i>[coming in with the Tree]</i>. Where shall I put it, ma’am?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000884": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000884",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000885": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000885",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHere, in the middle of the floor.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000886": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000886",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000887": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000887",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\nShall I get you anything else?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000888": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000888",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000889": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000889",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, thank you. I have all I want. [Exit MAID.]</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000890": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000890",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000891": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000891",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[begins dressing the tree]</i>. A candle here-and flowers here—The horrible man! It’s all nonsense—there’s nothing wrong. The tree shall be splendid! I will do everything I can think of to please you, Torvald!—I will sing for you, dance for you—<i>[HELMER comes in with some papers under his arm.]</i> Oh! are you back already?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000892": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000892",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000893": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000893",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes. Has anyone been here?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000894": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000894",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000895": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000895",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHere? No.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000896": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000896",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000897": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000897",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThat is strange. I saw Krogstad going out of the gate.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000898": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000898",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000899": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000899",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDid you? Oh yes, I forgot, Krogstad was here for a moment.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000900": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000900",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000901": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000901",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora, I can see from your manner that he has been here begging you to say a good word for him.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000902": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000902",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000903": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000903",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000904": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000904",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000905": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000905",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd you were to appear to do it of your own accord; you were to conceal from me the fact of his having been here; didn’t he beg that of you too?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000906": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000906",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000907": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000907",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, Torvald, but—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000908": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000908",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000909": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000909",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora, Nora, and you would be a party to that sort of thing? To have any talk with a man like that, and give him any sort of promise? And to tell me a lie into the bargain?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000910": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000910",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000911": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000911",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nA lie—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000912": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000912",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000913": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000913",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nDidn’t you tell me no one had been here? <i>[Shakes his finger at her.]</i> My little songbird must never do that again. A songbird must have a clean beak to chirp with—no false notes! <i>[Puts his arm round her waist.]</i> That is so, isn’t it? Yes, I am sure it is. <i>[Lets her go.]</i> We will say no more about it. <i>[Sits down by the stove.]</i> How warm and snug it is here! <i>[Turns over his papers.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000914": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000914",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000915": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000915",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[after a short pause, during which she busies herself with the Christmas Tree.]</i> Torvald!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000916": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000916",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000917": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000917",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000918": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000918",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000919": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000919",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI am looking forward tremendously to the fancy-dress ball at the Stenborgs’ the day after tomorrow.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000920": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000920",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000921": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000921",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd I am tremendously curious to see what you are going to surprise me with.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000922": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000922",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000923": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000923",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt was very silly of me to want to do that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000924": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000924",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000925": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000925",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat do you mean?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000926": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000926",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000927": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000927",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI can’t hit upon anything that will do; everything I think of seems so silly and insignificant.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000928": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000928",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000929": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000929",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nDoes my little Nora acknowledge that at last?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000930": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000930",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000931": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000931",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[standing behind his chair with her arms on the back of it]</i>. Are you very busy, Torvald?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000932": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000932",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000933": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000933",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWell—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000934": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000934",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000935": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000935",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat are all those papers?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000936": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000936",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000937": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000937",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBank business.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000938": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000938",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000939": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000939",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAlready?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000940": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000940",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000941": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000941",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nI have got authority from the retiring manager to undertake the necessary changes in the staff and in the rearrangement of the work; and I must make use of the Christmas week for that, so as to have everything in order for the new year.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000942": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000942",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000943": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000943",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThen that was why this poor Krogstad—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000944": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000944",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000945": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000945",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nHm!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000946": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000946",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000947": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000947",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[leans against the back of his chair and strokes his hair]</i>. If you hadn’t been so busy I should have asked you a tremendously big favour, Torvald.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000948": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000948",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000949": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000949",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat is that? Tell me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000950": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000950",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000951": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000951",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThere is no one has such good taste as you. And I do so want to look nice at the fancy-dress ball. Torvald, couldn’t you take me in hand and decide what I shall go as, and what sort of a dress I shall wear?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000952": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000952",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000953": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000953",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAha! so my obstinate little woman is obliged to get someone to come to her rescue?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000954": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000954",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000955": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000955",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, Torvald, I can’t get along a bit without your help.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000956": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000956",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000957": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000957",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nVery well, I will think it over, we shall manage to hit upon something.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000958": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000958",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000959": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000959",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThat is nice of you. <i>[Goes to the Christmas Tree. A short pause.]</i> How pretty the red flowers look—. But, tell me, was it really something very bad that this Krogstad was guilty of?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000960": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000960",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000961": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000961",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nHe forged someone’s name. Have you any idea what that means?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000962": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000962",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000963": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000963",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIsn’t it possible that he was driven to do it by necessity?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000964": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000964",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000965": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000965",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes; or, as in so many cases, by imprudence. I am not so heartless as to condemn a man altogether because of a single false step of that kind.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000966": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000966",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000967": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000967",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, you wouldn’t, would you, Torvald?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000968": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000968",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000969": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000969",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nMany a man has been able to retrieve his character, if he has openly confessed his fault and taken his punishment.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000970": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000970",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000971": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000971",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nPunishment—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000972": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000972",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000973": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000973",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut Krogstad did nothing of that sort; he got himself out of it by a cunning trick, and that is why he has gone under altogether.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000974": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000974",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000975": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000975",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBut do you think it would—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000976": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000976",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000977": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000977",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nJust think how a guilty man like that has to lie and play the hypocrite with every one, how he has to wear a mask in the presence of those near and dear to him, even before his own wife and children. And about the children—that is the most terrible part of it all, Nora.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000978": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000978",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000979": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000979",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHow?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000980": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000980",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000981": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000981",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBecause such an atmosphere of lies infects and poisons the whole life of a home. Each breath the children take in such a house is full of the germs of evil.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000982": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000982",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000983": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000983",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[coming nearer him]</i>. Are you sure of that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000984": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000984",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000985": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000985",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nMy dear, I have often seen it in the course of my life as a lawyer. Almost everyone who has gone to the bad early in life has had a deceitful mother.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000986": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000986",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000987": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000987",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhy do you only say—mother?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000988": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000988",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000989": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000989",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nIt seems most commonly to be the mother’s influence, though naturally a bad father’s would have the same result. Every lawyer is familiar with the fact. This Krogstad, now, has been persistently poisoning his own children with lies and dissimulation; that is why I say he has lost all moral character. <i>[Holds out his hands to her.]</i> That is why my sweet little Nora must promise me not to plead his cause. Give me your hand on it. Come, come, what is this? Give me your hand. There now, that’s settled. I assure you it would be quite impossible for me to work with him; I literally feel physically ill when I am in the company of such people.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000990": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000990",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000991": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000991",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[takes her hand out of his and goes to the opposite side of the Christmas Tree]</i>. How hot it is in here; and I have such a lot to do.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000992": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000992",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000993": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000993",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[getting up and putting his papers in order]</i>. Yes, and I must try and read through some of these before dinner; and I must think about your costume, too. And it is just possible I may have something ready in gold paper to hang up on the Tree. <i>[Puts his hand on her head.]</i> My precious little singing-bird! <i>[He goes into his room and shuts the door after him.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000994": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000994",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000995": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000995",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[after a pause, whispers]</i>. No, no—it isn’t true. It’s impossible; it must be impossible.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000996": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000996",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000997": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000997",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[The NURSE opens the door on the left.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000998": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000998",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000000999": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000000999",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nThe little ones are begging so hard to be allowed to come in to mamma.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001000": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001000",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001001": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001001",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, no, no! Don’t let them come in to me! You stay with them, Anne.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001002": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001002",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001003": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001003",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nVery well, ma’am. <i>[Shuts the door.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001004": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001004",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001005": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001005",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[pale with terror]</i>. Deprave my little children? Poison my home? <i>[A short pause. Then she tosses her head.]</i> It’s not true. It can’t possibly be true.<br>\n<br></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001006": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001006",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001007": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001007",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001008": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001008",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><h2><a></a>ACT II</h2></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001009": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001009",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001010": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001010",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[THE SAME SCENE.—THE Christmas Tree is in the corner by the piano, stripped of its ornaments and with burnt-down candle-ends on its dishevelled branches. NORA’S cloak and hat are lying on the sofa. She is alone in the room, walking about uneasily. She stops by the sofa and takes up her cloak.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001011": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001011",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001012": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001012",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[drops her cloak]</i>. Someone is coming now! <i>[Goes to the door and listens.]</i> No—it is no one. Of course, no one will come today, Christmas Day—nor tomorrow either. But, perhaps—<i>[opens the door and looks out]</i>. No, nothing in the letterbox; it is quite empty. <i>[Comes forward.]</i> What rubbish! of course he can’t be in earnest about it. Such a thing couldn’t happen; it is impossible—I have three little children.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001013": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001013",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001014": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001014",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[Enter the NURSE from the room on the left, carrying a big cardboard box.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001015": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001015",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001016": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001016",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nAt last I have found the box with the fancy dress.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001017": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001017",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001018": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001018",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThanks; put it on the table.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001019": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001019",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001020": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001020",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\n<i>[doing so]</i>. But it is very much in want of mending.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001021": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001021",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001022": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001022",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI should like to tear it into a hundred thousand pieces.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001023": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001023",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001024": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001024",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nWhat an idea! It can easily be put in order—just a little patience.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001025": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001025",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001026": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001026",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, I will go and get Mrs Linde to come and help me with it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001027": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001027",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001028": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001028",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nWhat, out again? In this horrible weather? You will catch cold, ma’am, and make yourself ill.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001029": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001029",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001030": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001030",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWell, worse than that might happen. How are the children?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001031": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001031",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001032": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001032",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nThe poor little souls are playing with their Christmas presents, but—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001033": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001033",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001034": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001034",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDo they ask much for me?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001035": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001035",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001036": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001036",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nYou see, they are so accustomed to have their mamma with them.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001037": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001037",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001038": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001038",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, but, nurse, I shall not be able to be so much with them now as I was before.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001039": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001039",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001040": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001040",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nOh well, young children easily get accustomed to anything.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001041": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001041",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001042": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001042",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDo you think so? Do you think they would forget their mother if she went away altogether?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001043": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001043",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001044": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001044",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nGood heavens!—went away altogether?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001045": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001045",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001046": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001046",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNurse, I want you to tell me something I have often wondered about—how could you have the heart to put your own child out among strangers?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001047": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001047",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001048": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001048",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nI was obliged to, if I wanted to be little Nora’s nurse.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001049": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001049",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001050": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001050",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, but how could you be willing to do it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001051": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001051",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001052": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001052",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nWhat, when I was going to get such a good place by it? A poor girl who has got into trouble should be glad to. Besides, that wicked man didn’t do a single thing for me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001053": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001053",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001054": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001054",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBut I suppose your daughter has quite forgotten you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001055": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001055",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001056": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001056",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nNo, indeed she hasn’t. She wrote to me when she was confirmed, and when she was married.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001057": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001057",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001058": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001058",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[putting her arms round her neck]</i>. Dear old Anne, you were a good mother to me when I was little.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001059": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001059",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001060": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001060",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nLittle Nora, poor dear, had no other mother but me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001061": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001061",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001062": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001062",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd if my little ones had no other mother, I am sure you would—What nonsense I am talking! <i>[Opens the box.]</i> Go in to them. Now I must—. You will see tomorrow how charming I shall look.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001063": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001063",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001064": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001064",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NURSE.<br>\nI am sure there will be no one at the ball so charming as you, ma’am. <i>[Goes into the room on the left.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001065": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001065",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001066": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001066",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[begins to unpack the box, but soon pushes it away from her]</i>. If only I dared go out. If only no one would come. If only I could be sure nothing would happen here in the meantime. Stuff and nonsense! No one will come. Only I mustn’t think about it. I will brush my muff. What lovely, lovely gloves! Out of my thoughts, out of my thoughts! One, two, three, four, five, six— <i>[Screams.]</i> Ah! there is someone coming—. <i>[Makes a movement towards the door, but stands irresolute.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001067": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001067",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001068": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001068",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[Enter Mrs Linde from the hall, where she has taken off her cloak and hat.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001069": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001069",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001070": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001070",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOh, it’s you, Christine. There is no one else out there, is there? How good of you to come!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001071": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001071",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001072": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001072",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI heard you were up asking for me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001073": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001073",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001074": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001074",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, I was passing by. As a matter of fact, it is something you could help me with. Let us sit down here on the sofa. Look here. Tomorrow evening there is to be a fancy-dress ball at the Stenborgs’, who live above us; and Torvald wants me to go as a Neapolitan fisher-girl, and dance the Tarantella that I learned at Capri.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001075": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001075",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001076": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001076",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI see; you are going to keep up the character.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001077": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001077",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001078": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001078",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, Torvald wants me to. Look, here is the dress; Torvald had it made for me there, but now it is all so torn, and I haven’t any idea—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001079": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001079",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001080": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001080",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWe will easily put that right. It is only some of the trimming come unsewn here and there. Needle and thread? Now then, that’s all we want.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001081": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001081",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001082": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001082",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt is nice of you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001083": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001083",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001084": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001084",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[sewing]</i>. So you are going to be dressed up tomorrow Nora. I will tell you what—I shall come in for a moment and see you in your fine feathers. But I have completely forgotten to thank you for a delightful evening yesterday.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001085": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001085",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001086": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001086",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[gets up, and crosses the stage]</i>. Well, I don’t think yesterday was as pleasant as usual. You ought to have come to town a little earlier, Christine. Certainly Torvald does understand how to make a house dainty and attractive.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001087": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001087",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001088": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001088",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nAnd so do you, it seems to me; you are not your father’s daughter for nothing. But tell me, is Doctor Rank always as depressed as he was yesterday?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001089": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001089",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001090": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001090",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo; yesterday it was very noticeable. I must tell you that he suffers from a very dangerous disease. He has consumption of the spine, poor creature. His father was a horrible man who committed all sorts of excesses; and that is why his son was sickly from childhood, do you understand?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001091": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001091",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001092": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[dropping her sewing]</i>. But, my dearest Nora, how do you know anything about such things?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001093": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001093",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001094": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001094",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[walking about]</i>. Pooh! When you have three children, you get visits now and then from—from married women, who know something of medical matters, and they talk about one thing and another.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001095": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001095",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001096": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001096",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[goes on sewing. A short silence]</i>. Does Doctor Rank come here everyday?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001097": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001097",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001098": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001098",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nEveryday regularly. He is Torvald’s most intimate friend, and a great friend of mine too. He is just like one of the family.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001099": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001099",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001100": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001100",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBut tell me this—is he perfectly sincere? I mean, isn’t he the kind of man that is very anxious to make himself agreeable?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001101": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001101",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001102": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001102",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNot in the least. What makes you think that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001103": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001103",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001104": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001104",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWhen you introduced him to me yesterday, he declared he had often heard my name mentioned in this house; but afterwards I noticed that your husband hadn’t the slightest idea who I was. So how could Doctor Rank—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001105": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001105",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001106": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001106",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThat is quite right, Christine. Torvald is so absurdly fond of me that he wants me absolutely to himself, as he says. At first he used to seem almost jealous if I mentioned any of the dear folk at home, so naturally I gave up doing so. But I often talk about such things with Doctor Rank, because he likes hearing about them.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001107": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001107",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001108": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001108",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nListen to me, Nora. You are still very like a child in many things, and I am older than you in many ways and have a little more experience. Let me tell you this—you ought to make an end of it with Doctor Rank.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001109": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001110": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001110",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat ought I to make an end of?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001111": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001111",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001112": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nOf two things, I think. Yesterday you talked some nonsense about a rich admirer who was to leave you money—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001113": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001114": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001114",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAn admirer who doesn’t exist, unfortunately! But what then?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001115": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001115",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001116": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001116",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nIs Doctor Rank a man of means?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001117": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001117",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001118": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001118",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, he is.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001119": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001119",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001120": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001120",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nAnd has no one to provide for?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001121": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001121",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001122": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001122",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, no one; but—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001123": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001123",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001124": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001124",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nAnd comes here everyday?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001125": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001125",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001126": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001126",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, I told you so.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001127": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001127",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001128": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001128",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBut how can this well-bred man be so tactless?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001129": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001129",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001130": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001130",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI don’t understand you at all.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001131": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001131",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001132": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001132",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nDon’t prevaricate, Nora. Do you suppose I don’t guess who lent you the two hundred and fifty pounds?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001133": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001133",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001134": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001134",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAre you out of your senses? How can you think of such a thing! A friend of ours, who comes here everyday! Do you realise what a horribly painful position that would be?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001135": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001135",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001136": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001136",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nThen it really isn’t he?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001137": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001137",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001138": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001138",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, certainly not. It would never have entered into my head for a moment. Besides, he had no money to lend then; he came into his money afterwards.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001139": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001139",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001140": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001140",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWell, I think that was lucky for you, my dear Nora.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001141": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001141",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001142": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001142",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, it would never have come into my head to ask Doctor Rank. Although I am quite sure that if I had asked him—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001143": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001143",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001144": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001144",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBut of course you won’t.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001145": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001145",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001146": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001146",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOf course not. I have no reason to think it could possibly be necessary. But I am quite sure that if I told Doctor Rank—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001147": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001147",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001148": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001148",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBehind your husband’s back?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001149": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001149",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001150": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001150",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI must make an end of it with the other one, and that will be behind his back too. I must make an end of it with him.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001151": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001151",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001152": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001152",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, that is what I told you yesterday, but—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001153": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001153",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001154": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001154",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[walking up and down]</i>. A man can put a thing like that straight much easier than a woman—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001155": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001155",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001156": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001156",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nOne’s husband, yes.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001157": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001157",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001158": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001158",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNonsense! <i>[Standing still.]</i> When you pay off a debt you get your bond back, don’t you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001159": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001159",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001160": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001160",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, as a matter of course.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001161": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001161",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001162": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001162",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd can tear it into a hundred thousand pieces, and burn it up—the nasty dirty paper!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001163": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001163",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001164": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001164",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[looks hard at her, lays down her sewing and gets up slowly]</i>. Nora, you are concealing something from me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001165": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001165",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001166": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001166",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDo I look as if I were?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001167": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001167",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001168": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001168",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nSomething has happened to you since yesterday morning. Nora, what is it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001169": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001169",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001170": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001170",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[going nearer to her]</i>. Christine! <i>[Listens.]</i> Hush! there’s Torvald come home. Do you mind going in to the children for the present? Torvald can’t bear to see dressmaking going on. Let Anne help you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001171": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001171",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001172": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001172",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[gathering some of the things together]</i>. Certainly—but I am not going away from here until we have had it out with one another. <i>[She goes into the room on the left, as HELMER comes in from the hall.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001173": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001173",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001174": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001174",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[going up to HELMER]</i>. I have wanted you so much, Torvald dear.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001175": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001175",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001176": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001176",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWas that the dressmaker?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001177": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001177",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001178": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001178",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, it was Christine; she is helping me to put my dress in order. You will see I shall look quite smart.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001179": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001179",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001180": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001180",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWasn’t that a happy thought of mine, now?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001181": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001181",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001182": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001182",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nSplendid! But don’t you think it is nice of me, too, to do as you wish?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001183": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001183",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001184": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001184",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNice?—because you do as your husband wishes? Well, well, you little rogue, I am sure you did not mean it in that way. But I am not going to disturb you; you will want to be trying on your dress, I expect.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001185": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001185",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001186": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001186",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI suppose you are going to work.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001187": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001187",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001188": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001188",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes. <i>[Shows her a bundle of papers.]</i> Look at that. I have just been into the bank. <i>[Turns to go into his room.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001189": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001189",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001190": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001190",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nTorvald.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001191": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001191",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001192": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001192",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001193": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001193",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001194": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001194",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIf your little squirrel were to ask you for something very, very prettily—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001195": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001195",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001196": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001196",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat then?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001197": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001197",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001198": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001198",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWould you do it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001199": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001199",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001200": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001200",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nI should like to hear what it is, first.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001201": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001201",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001202": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001202",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYour squirrel would run about and do all her tricks if you would be nice, and do what she wants.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001203": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001203",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001204": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001204",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nSpeak plainly.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001205": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001205",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001206": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001206",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYour skylark would chirp about in every room, with her song rising and falling—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001207": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001207",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001208": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001208",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWell, my skylark does that anyhow.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001209": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001209",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001210": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001210",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI would play the fairy and dance for you in the moonlight, Torvald.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001211": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001211",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001212": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001212",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora—you surely don’t mean that request you made to me this morning?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001213": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001213",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001214": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001214",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[going near him]</i>. Yes, Torvald, I beg you so earnestly—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001215": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001215",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001216": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001216",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nHave you really the courage to open up that question again?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001217": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001217",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001218": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001218",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, dear, you must do as I ask; you must let Krogstad keep his post in the bank.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001219": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001219",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001220": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001220",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nMy dear Nora, it is his post that I have arranged Mrs Linde shall have.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001221": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001221",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001222": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001222",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, you have been awfully kind about that; but you could just as well dismiss some other clerk instead of Krogstad.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001223": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001223",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001224": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001224",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThis is simply incredible obstinacy! Because you chose to give him a thoughtless promise that you would speak for him, I am expected to—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001225": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001225",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001226": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001226",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThat isn’t the reason, Torvald. It is for your own sake. This fellow writes in the most scurrilous newspapers; you have told me so yourself. He can do you an unspeakable amount of harm. I am frightened to death of him—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001227": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001227",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001228": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001228",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAh, I understand; it is recollections of the past that scare you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001229": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001229",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001230": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001230",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat do you mean?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001231": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001231",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001232": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001232",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNaturally you are thinking of your father.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001233": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001233",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001234": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001234",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes—yes, of course. Just recall to your mind what these malicious creatures wrote in the papers about papa, and how horribly they slandered him. I believe they would have procured his dismissal if the Department had not sent you over to inquire into it, and if you had not been so kindly disposed and helpful to him.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001235": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001235",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001236": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001236",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nMy little Nora, there is an important difference between your father and me. Your father’s reputation as a public official was not above suspicion. Mine is, and I hope it will continue to be so, as long as I hold my office.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001237": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001237",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001238": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001238",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou never can tell what mischief these men may contrive. We ought to be so well off, so snug and happy here in our peaceful home, and have no cares—you and I and the children, Torvald! That is why I beg you so earnestly—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001239": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001239",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001240": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001240",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd it is just by interceding for him that you make it impossible for me to keep him. It is already known at the Bank that I mean to dismiss Krogstad. Is it to get about now that the new manager has changed his mind at his wife’s bidding—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001241": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001241",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001242": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001242",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd what if it did?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001243": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001243",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001244": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001244",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nOf course!—if only this obstinate little person can get her way! Do you suppose I am going to make myself ridiculous before my whole staff, to let people think that I am a man to be swayed by all sorts of outside influence? I should very soon feel the consequences of it, I can tell you! And besides, there is one thing that makes it quite impossible for me to have Krogstad in the Bank as long as I am manager.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001245": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001245",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001246": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001246",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhatever is that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001247": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001247",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001248": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001248",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nHis moral failings I might perhaps have overlooked, if necessary—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001249": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001249",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001250": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001250",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, you could—couldn’t you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001251": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001251",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001252": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001252",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd I hear he is a good worker, too. But I knew him when we were boys. It was one of those rash friendships that so often prove an incubus in afterlife. I may as well tell you plainly, we were once on very intimate terms with one another. But this tactless fellow lays no restraint on himself when other people are present. On the contrary, he thinks it gives him the right to adopt a familiar tone with me, and every minute it is “I say, Helmer, old fellow!” and that sort of thing. I assure you it is extremely painful for me. He would make my position in the Bank intolerable.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001253": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001253",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001254": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001254",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nTorvald, I don’t believe you mean that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001255": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001255",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001256": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001256",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nDon’t you? Why not?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001257": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001257",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001258": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001258",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBecause it is such a narrow-minded way of looking at things.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001259": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001259",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001260": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001260",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat are you saying? Narrow-minded? Do you think I am narrow-minded?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001261": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001261",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001262": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001262",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, just the opposite, dear—and it is exactly for that reason.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001263": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001263",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001264": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001264",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nIt’s the same thing. You say my point of view is narrow-minded, so I must be so too. Narrow-minded! Very well—I must put an end to this. <i>[Goes to the hall door and calls.]</i> Helen!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001265": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001265",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001266": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001266",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat are you going to do?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001267": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001267",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001268": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001268",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[looking among his papers]</i>. Settle it. <i>[Enter MAID.]</i> Look here; take this letter and go downstairs with it at once. Find a messenger and tell him to deliver it, and be quick. The address is on it, and here is the money.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001269": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001269",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001270": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001270",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\nVery well, sir. <i>[Exit with the letter.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001271": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001271",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001272": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001272",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[putting his papers together]</i>. Now then, little Miss Obstinate.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001273": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001273",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001274": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001274",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[breathlessly]</i>. Torvald—what was that letter?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001275": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001275",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001276": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001276",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nKrogstad’s dismissal.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001277": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001277",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001278": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001278",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nCall her back, Torvald! There is still time. Oh Torvald, call her back! Do it for my sake—for your own sake—for the children’s sake! Do you hear me, Torvald? Call her back! You don’t know what that letter can bring upon us.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001279": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001279",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001280": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001280",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nIt’s too late.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001281": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001281",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001282": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001282",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, it’s too late.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001283": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001283",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001284": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001284",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nMy dear Nora, I can forgive the anxiety you are in, although really it is an insult to me. It is, indeed. Isn’t it an insult to think that I should be afraid of a starving quill-driver’s vengeance? But I forgive you nevertheless, because it is such eloquent witness to your great love for me. <i>[Takes her in his arms.]</i> And that is as it should be, my own darling Nora. Come what will, you may be sure I shall have both courage and strength if they be needed. You will see I am man enough to take everything upon myself.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001285": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001285",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001286": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001286",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[in a horror-stricken voice]</i>. What do you mean by that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001287": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001287",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001288": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001288",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nEverything, I say—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001289": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001289",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001290": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001290",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[recovering herself]</i>. You will never have to do that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001291": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001291",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001292": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001292",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThat’s right. Well, we will share it, Nora, as man and wife should. That is how it shall be. <i>[Caressing her.]</i> Are you content now? There! There!—not these frightened dove’s eyes! The whole thing is only the wildest fancy!—Now, you must go and play through the Tarantella and practise with your tambourine. I shall go into the inner office and shut the door, and I shall hear nothing; you can make as much noise as you please. <i>[Turns back at the door.]</i> And when Rank comes, tell him where he will find me. <i>[Nods to her, takes his papers and goes into his room, and shuts the door after him.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001293": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001293",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001294": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001294",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[bewildered with anxiety, stands as if rooted to the spot, and whispers]</i>. He was capable of doing it. He will do it. He will do it in spite of everything.—No, not that! Never, never! Anything rather than that! Oh, for some help, some way out of it! <i>[The door-bell rings.]</i> Doctor Rank! Anything rather than that—anything, whatever it is! <i>[She puts her hands over her face, pulls herself together, goes to the door and opens it. RANK is standing without, hanging up his coat. During the following dialogue it begins to grow dark.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001295": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001295",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001296": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001296",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nGood day, Doctor Rank. I knew your ring. But you mustn’t go in to Torvald now; I think he is busy with something.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001297": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001297",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001298": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001298",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nAnd you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001299": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001299",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001300": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001300",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[brings him in and shuts the door after him]</i>. Oh, you know very well I always have time for you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001301": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001301",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001302": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001302",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nThank you. I shall make use of as much of it as I can.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001303": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001303",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001304": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001304",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat do you mean by that? As much of it as you can?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001305": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001305",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001306": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001306",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWell, does that alarm you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001307": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001307",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001308": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001308",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt was such a strange way of putting it. Is anything likely to happen?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001309": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001309",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001310": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001310",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nNothing but what I have long been prepared for. But I certainly didn’t expect it to happen so soon.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001311": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001311",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001312": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001312",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[gripping him by the arm]</i>. What have you found out? Doctor Rank, you must tell me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001313": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001313",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001314": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001314",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[sitting down by the stove]</i>. It is all up with me. And it can’t be helped.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001315": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001315",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001316": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001316",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[with a sigh of relief]</i>. Is it about yourself?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001317": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001317",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001318": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001318",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWho else? It is no use lying to one’s self. I am the most wretched of all my patients, Mrs Helmer. Lately I have been taking stock of my internal economy. Bankrupt! Probably within a month I shall lie rotting in the churchyard.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001319": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001319",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001320": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001320",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat an ugly thing to say!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001321": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001321",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001322": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001322",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nThe thing itself is cursedly ugly, and the worst of it is that I shall have to face so much more that is ugly before that. I shall only make one more examination of myself; when I have done that, I shall know pretty certainly when it will be that the horrors of dissolution will begin. There is something I want to tell you. Helmer’s refined nature gives him an unconquerable disgust at everything that is ugly; I won’t have him in my sick-room.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001323": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001323",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001324": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001324",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOh, but, Doctor Rank—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001325": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001325",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001326": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001326",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nI won’t have him there. Not on any account. I bar my door to him. As soon as I am quite certain that the worst has come, I shall send you my card with a black cross on it, and then you will know that the loathsome end has begun.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001327": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001327",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001328": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001328",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou are quite absurd today. And I wanted you so much to be in a really good humour.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001329": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001329",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001330": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001330",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWith death stalking beside me?—To have to pay this penalty for another man’s sin? Is there any justice in that? And in every single family, in one way or another, some such inexorable retribution is being exacted—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001331": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001331",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001332": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001332",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[putting her hands over her ears]</i>. Rubbish! Do talk of something cheerful.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001333": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001333",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001334": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001334",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nOh, it’s a mere laughing matter, the whole thing. My poor innocent spine has to suffer for my father’s youthful amusements.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001335": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001335",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001336": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001336",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[sitting at the table on the left]</i>. I suppose you mean that he was too partial to asparagus and pate de foie gras, don’t you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001337": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001337",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001338": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001338",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nYes, and to truffles.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001339": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001339",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001340": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001340",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nTruffles, yes. And oysters too, I suppose?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001341": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001341",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001342": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001342",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nOysters, of course, that goes without saying.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001343": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001343",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001344": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001344",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd heaps of port and champagne. It is sad that all these nice things should take their revenge on our bones.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001345": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001345",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001346": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001346",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nEspecially that they should revenge themselves on the unlucky bones of those who have not had the satisfaction of enjoying them.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001347": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001347",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001348": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001348",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, that’s the saddest part of it all.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001349": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001349",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001350": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001350",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[with a searching look at her]</i>. Hm!—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001351": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001351",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001352": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001352",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[after a short pause]</i>. Why did you smile?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001353": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001353",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001354": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001354",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nNo, it was you that laughed.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001355": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001355",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001356": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001356",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, it was you that smiled, Doctor Rank!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001357": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001357",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001358": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001358",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[rising]</i>. You are a greater rascal than I thought.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001359": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001359",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001360": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001360",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI am in a silly mood today.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001361": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001361",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001362": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001362",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nSo it seems.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001363": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001363",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001364": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001364",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[putting her hands on his shoulders]</i>. Dear, dear Doctor Rank, death mustn’t take you away from Torvald and me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001365": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001365",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001366": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001366",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nIt is a loss you would easily recover from. Those who are gone are soon forgotten.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001367": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001367",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001368": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001368",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[looking at him anxiously]</i>. Do you believe that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001369": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001369",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001370": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001370",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nPeople form new ties, and then—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001371": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001371",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001372": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001372",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWho will form new ties?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001373": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001373",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001374": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001374",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nBoth you and Helmer, when I am gone. You yourself are already on the high road to it, I think. What did that Mrs Linde want here last night?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001375": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001375",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001376": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001376",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOho!—you don’t mean to say you are jealous of poor Christine?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001377": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001377",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001378": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001378",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nYes, I am. She will be my successor in this house. When I am done for, this woman will—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001379": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001379",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001380": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001380",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHush! don’t speak so loud. She is in that room.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001381": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001381",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001382": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001382",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nToday again. There, you see.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001383": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001383",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001384": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001384",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nShe has only come to sew my dress for me. Bless my soul, how unreasonable you are! <i>[Sits down on the sofa.]</i> Be nice now, Doctor Rank, and tomorrow you will see how beautifully I shall dance, and you can imagine I am doing it all for you—and for Torvald too, of course. <i>[Takes various things out of the box.]</i> Doctor Rank, come and sit down here, and I will show you something.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001385": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001385",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001386": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001386",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[sitting down]</i>. What is it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001387": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001387",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001388": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001388",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nJust look at those!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001389": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001389",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001390": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001390",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nSilk stockings.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001391": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001391",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001392": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001392",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nFlesh-coloured. Aren’t they lovely? It is so dark here now, but tomorrow—. No, no, no! you must only look at the feet. Oh well, you may have leave to look at the legs too.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001393": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001393",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001394": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001394",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nHm!—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001395": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001395",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001396": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001396",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhy are you looking so critical? Don’t you think they will fit me?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001397": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001397",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001398": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001398",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nI have no means of forming an opinion about that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001399": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001399",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001400": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001400",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[looks at him for a moment]</i>. For shame! <i>[Hits him lightly on the ear with the stockings.]</i> That’s to punish you. <i>[Folds them up again.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001401": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001401",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001402": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001402",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nAnd what other nice things am I to be allowed to see?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001403": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001403",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001404": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001404",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNot a single thing more, for being so naughty. <i>[She looks among the things, humming to herself.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001405": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001405",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001406": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001406",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[after a short silence]</i>. When I am sitting here, talking to you as intimately as this, I cannot imagine for a moment what would have become of me if I had never come into this house.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001407": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001407",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001408": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001408",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[smiling]</i>. I believe you do feel thoroughly at home with us.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001409": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001409",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001410": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001410",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[in a lower voice, looking straight in front of him]</i>. And to be obliged to leave it all—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001411": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001411",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001412": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001412",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNonsense, you are not going to leave it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001413": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001413",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001414": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001414",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[as before]</i>. And not be able to leave behind one the slightest token of one’s gratitude, scarcely even a fleeting regret—nothing but an empty place which the first comer can fill as well as any other.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001415": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001415",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001416": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001416",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd if I asked you now for a—? No!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001417": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001417",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001418": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001418",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nFor what?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001419": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001419",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001420": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001420",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nFor a big proof of your friendship—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001421": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001421",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001422": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001422",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nYes, yes!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001423": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001423",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001424": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001424",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI mean a tremendously big favour—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001425": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001425",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001426": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001426",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWould you really make me so happy for once?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001427": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001427",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001428": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001428",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAh, but you don’t know what it is yet.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001429": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001429",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001430": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001430",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nNo—but tell me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001431": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001431",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001432": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001432",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI really can’t, Doctor Rank. It is something out of all reason; it means advice, and help, and a favour—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001433": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001433",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001434": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001434",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nThe bigger a thing it is the better. I can’t conceive what it is you mean. Do tell me. Haven’t I your confidence?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001435": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001435",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001436": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001436",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nMore than anyone else. I know you are my truest and best friend, and so I will tell you what it is. Well, Doctor Rank, it is something you must help me to prevent. You know how devotedly, how inexpressibly deeply Torvald loves me; he would never for a moment hesitate to give his life for me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001437": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001437",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001438": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001438",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[leaning towards her]</i>. Nora—do you think he is the only one—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001439": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001439",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001440": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001440",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[with a slight start]</i>. The only one—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001441": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001441",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001442": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001442",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nThe only one who would gladly give his life for your sake.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001443": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001443",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001444": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001444",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[sadly]</i>. Is that it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001445": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001445",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001446": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001446",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nI was determined you should know it before I went away, and there will never be a better opportunity than this. Now you know it, Nora. And now you know, too, that you can trust me as you would trust no one else.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001447": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001447",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001448": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001448",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[rises, deliberately and quietly]</i>. Let me pass.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001449": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001449",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001450": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001450",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[makes room for her to pass him, but sits still]</i>. Nora!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001451": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001451",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001452": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001452",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[at the hall door]</i>. Helen, bring in the lamp. <i>[Goes over to the stove.]</i> Dear Doctor Rank, that was really horrid of you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001453": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001453",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001454": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001454",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nTo have loved you as much as anyone else does? Was that horrid?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001455": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001455",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001456": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001456",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, but to go and tell me so. There was really no need—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001457": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001457",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001458": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001458",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWhat do you mean? Did you know—? <i>[MAID enters with lamp, puts it down on the table, and goes out.]</i> Nora—Mrs Helmer—tell me, had you any idea of this?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001459": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001459",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001460": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001460",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOh, how do I know whether I had or whether I hadn’t? I really can’t tell you—To think you could be so clumsy, Doctor Rank! We were getting on so nicely.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001461": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001461",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001462": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001462",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWell, at all events you know now that you can command me, body and soul. So won’t you speak out?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001463": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001463",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001464": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001464",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[looking at him]</i>. After what happened?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001465": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001465",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001466": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001466",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nI beg you to let me know what it is.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001467": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001467",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001468": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001468",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI can’t tell you anything now.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001469": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001469",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001470": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001470",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nYes, yes. You mustn’t punish me in that way. Let me have permission to do for you whatever a man may do.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001471": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001471",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001472": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001472",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou can do nothing for me now. Besides, I really don’t need any help at all. You will find that the whole thing is merely fancy on my part. It really is so—of course it is! <i>[Sits down in the rocking-chair, and looks at him with a smile.]</i> You are a nice sort of man, Doctor Rank!—don’t you feel ashamed of yourself, now the lamp has come?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001473": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001473",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001474": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001474",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nNot a bit. But perhaps I had better go—for ever?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001475": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001475",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001476": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001476",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, indeed, you shall not. Of course you must come here just as before. You know very well Torvald can’t do without you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001477": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001477",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001478": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001478",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nYes, but you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001479": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001479",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001480": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001480",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOh, I am always tremendously pleased when you come.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001481": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001481",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001482": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001482",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nIt is just that, that put me on the wrong track. You are a riddle to me. I have often thought that you would almost as soon be in my company as in Helmer’s.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001483": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001483",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001484": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001484",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes—you see there are some people one loves best, and others whom one would almost always rather have as companions.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001485": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001485",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001486": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001486",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nYes, there is something in that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001487": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001487",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001488": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001488",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhen I was at home, of course I loved papa best. But I always thought it tremendous fun if I could steal down into the maids’ room, because they never moralised at all, and talked to each other about such entertaining things.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001489": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001489",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001490": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001490",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nI see—it is their place I have taken.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001491": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001491",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001492": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001492",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[jumping up and going to him]</i>. Oh, dear, nice Doctor Rank, I never meant that at all. But surely you can understand that being with Torvald is a little like being with papa—<i>[Enter MAID from the hall.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001493": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001493",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001494": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001494",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\nIf you please, ma’am. <i>[Whispers and hands her a card.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001495": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001495",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001496": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001496",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[glancing at the card]</i>. Oh! <i>[Puts it in her pocket.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001497": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001497",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001498": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001498",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nIs there anything wrong?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001499": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001499",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001500": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001500",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, no, not in the least. It is only something—it is my new dress—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001501": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001501",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001502": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001502",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWhat? Your dress is lying there.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001503": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001503",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001504": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001504",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOh, yes, that one; but this is another. I ordered it. Torvald mustn’t know about it—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001505": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001505",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001506": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001506",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nOho! Then that was the great secret.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001507": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001507",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001508": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001508",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOf course. Just go in to him; he is sitting in the inner room. Keep him as long as—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001509": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001509",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001510": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001510",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nMake your mind easy; I won’t let him escape.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001511": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001511",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001512": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001512",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[Goes into HELMER’S room.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001513": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001513",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001514": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001514",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[to the MAID]</i>. And he is standing waiting in the kitchen?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001515": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001515",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001516": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001516",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\nYes; he came up the back stairs.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001517": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001517",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001518": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001518",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBut didn’t you tell him no one was in?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001519": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001519",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001520": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001520",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\nYes, but it was no good.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001521": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001521",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001522": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001522",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHe won’t go away?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001523": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001523",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001524": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001524",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\nNo; he says he won’t until he has seen you, ma’am.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001525": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001525",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001526": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001526",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWell, let him come in—but quietly. Helen, you mustn’t say anything about it to anyone. It is a surprise for my husband.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001527": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001527",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001528": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001528",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\nYes, ma’am, I quite understand. <i>[Exit.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001529": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001529",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001530": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001530",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThis dreadful thing is going to happen! It will happen in spite of me! No, no, no, it can’t happen—it shan’t happen! <i>[She bolts the door of HELMER’S room. The MAID opens the hall door for KROGSTAD and shuts it after him. He is wearing a fur coat, high boots and a fur cap.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001531": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001531",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001532": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001532",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[advancing towards him]</i>. Speak low—my husband is at home.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001533": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001533",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001534": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001534",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nNo matter about that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001535": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001535",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001536": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001536",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat do you want of me?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001537": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001537",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001538": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001538",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nAn explanation of something.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001539": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001539",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001540": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001540",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nMake haste then. What is it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001541": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001541",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001542": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001542",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nYou know, I suppose, that I have got my dismissal.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001543": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001543",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001544": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001544",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI couldn’t prevent it, Mr. Krogstad. I fought as hard as I could on your side, but it was no good.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001545": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001545",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001546": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001546",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nDoes your husband love you so little, then? He knows what I can expose you to, and yet he ventures—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001547": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001547",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001548": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001548",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHow can you suppose that he has any knowledge of the sort?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001549": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001549",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001550": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001550",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI didn’t suppose so at all. It would not be the least like our dear Torvald Helmer to show so much courage—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001551": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001551",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001552": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001552",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nMr. Krogstad, a little respect for my husband, please.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001553": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001553",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001554": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001554",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nCertainly—all the respect he deserves. But since you have kept the matter so carefully to yourself, I make bold to suppose that you have a little clearer idea, than you had yesterday, of what it actually is that you have done?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001555": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001555",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001556": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001556",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nMore than you could ever teach me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001557": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001557",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001558": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001558",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nYes, such a bad lawyer as I am.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001559": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001559",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001560": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001560",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat is it you want of me?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001561": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001561",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001562": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001562",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nOnly to see how you were, Mrs Helmer. I have been thinking about you all day long. A mere cashier, a quill-driver, a—well, a man like me—even he has a little of what is called feeling, you know.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001563": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001563",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001564": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001564",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nShow it, then; think of my little children.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001565": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001565",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001566": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001566",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nHave you and your husband thought of mine? But never mind about that. I only wanted to tell you that you need not take this matter too seriously. In the first place there will be no accusation made on my part.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001567": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001567",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001568": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001568",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, of course not; I was sure of that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001569": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001569",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001570": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001570",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nThe whole thing can be arranged amicably; there is no reason why anyone should know anything about it. It will remain a secret between us three.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001571": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001571",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001572": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001572",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nMy husband must never get to know anything about it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001573": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001573",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001574": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001574",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nHow will you be able to prevent it? Am I to understand that you can pay the balance that is owing?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001575": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001575",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001576": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001576",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, not just at present.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001577": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001577",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001578": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001578",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nOr perhaps that you have some expedient for raising the money soon?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001579": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001579",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001580": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001580",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo expedient that I mean to make use of.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001581": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001581",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001582": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001582",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nWell, in any case, it would have been of no use to you now. If you stood there with ever so much money in your hand, I would never part with your bond.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001583": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001583",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001584": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001584",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nTell me what purpose you mean to put it to.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001585": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001585",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001586": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001586",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI shall only preserve it—keep it in my possession. No one who is not concerned in the matter shall have the slightest hint of it. So that if the thought of it has driven you to any desperate resolution—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001587": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001587",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001588": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001588",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt has.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001589": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001589",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001590": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001590",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nIf you had it in your mind to run away from your home—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001591": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001591",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001592": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001592",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI had.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001593": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001593",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001594": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001594",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nOr even something worse—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001595": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001595",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001596": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001596",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHow could you know that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001597": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001597",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001598": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001598",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nGive up the idea.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001599": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001599",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001600": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001600",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHow did you know I had thought of that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001601": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001601",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001602": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001602",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nMost of us think of that at first. I did, too—but I hadn’t the courage.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001603": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001603",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001604": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001604",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[faintly]</i>. No more had I.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001605": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001605",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001606": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001606",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\n<i>[in a tone of relief]</i>. No, that’s it, isn’t it—you hadn’t the courage either?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001607": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001607",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001608": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001608",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, I haven’t—I haven’t.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001609": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001609",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001610": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001610",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nBesides, it would have been a great piece of folly. Once the first storm at home is over—. I have a letter for your husband in my pocket.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001611": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001611",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001612": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001612",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nTelling him everything?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001613": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001613",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001614": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001614",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nIn as lenient a manner as I possibly could.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001615": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001615",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001616": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001616",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[quickly]</i>. He mustn’t get the letter. Tear it up. I will find some means of getting money.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001617": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001617",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001618": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001618",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nExcuse me, Mrs Helmer, but I think I told you just now—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001619": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001619",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001620": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001620",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI am not speaking of what I owe you. Tell me what sum you are asking my husband for, and I will get the money.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001621": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001621",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001622": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001622",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI am not asking your husband for a penny.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001623": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001623",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001624": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001624",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat do you want, then?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001625": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001625",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001626": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001626",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI will tell you. I want to rehabilitate myself, Mrs Helmer; I want to get on; and in that your husband must help me. For the last year and a half I have not had a hand in anything dishonourable, amid all that time I have been struggling in most restricted circumstances. I was content to work my way up step by step. Now I am turned out, and I am not going to be satisfied with merely being taken into favour again. I want to get on, I tell you. I want to get into the Bank again, in a higher position. Your husband must make a place for me—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001627": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001627",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001628": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001628",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThat he will never do!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001629": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001629",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001630": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001630",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nHe will; I know him; he dare not protest. And as soon as I am in there again with him, then you will see! Within a year I shall be the manager’s right hand. It will be Nils Krogstad and not Torvald Helmer who manages the Bank.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001631": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001631",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001632": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001632",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThat’s a thing you will never see!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001633": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001633",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001634": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001634",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nDo you mean that you will—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001635": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001635",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001636": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001636",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI have courage enough for it now.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001637": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001637",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001638": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001638",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nOh, you can’t frighten me. A fine, spoilt lady like you—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001639": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001639",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001640": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001640",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou will see, you will see.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001641": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001641",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001642": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001642",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nUnder the ice, perhaps? Down into the cold, coal-black water? And then, in the spring, to float up to the surface, all horrible and unrecognisable, with your hair fallen out—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001643": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001643",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001644": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001644",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou can’t frighten me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001645": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001645",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001646": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001646",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nNor you me. People don’t do such things, Mrs Helmer. Besides, what use would it be? I should have him completely in my power all the same.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001647": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001647",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001648": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001648",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAfterwards? When I am no longer—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001649": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001649",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001650": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001650",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nHave you forgotten that it is I who have the keeping of your reputation? <i>[NORA stands speechlessly looking at him.]</i> Well, now, I have warned you. Do not do anything foolish. When Helmer has had my letter, I shall expect a message from him. And be sure you remember that it is your husband himself who has forced me into such ways as this again. I will never forgive him for that. Goodbye, Mrs Helmer. <i>[Exit through the hall.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001651": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001651",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001652": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001652",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[goes to the hall door, opens it slightly and listens.]</i> He is going. He is not putting the letter in the box. Oh no, no! that’s impossible! <i>[Opens the door by degrees.]</i> What is that? He is standing outside. He is not going downstairs. Is he hesitating? Can he—? <i>[A letter drops into the box; then KROGSTAD’S footsteps are heard, until they die away as he goes downstairs. NORA utters a stifled cry, and runs across the room to the table by the sofa. A short pause.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001653": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001653",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001654": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001654",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIn the letter-box. <i>[Steals across to the hall door.]</i> There it lies—Torvald, Torvald, there is no hope for us now!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001655": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001655",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001656": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001656",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[Mrs Linde comes in from the room on the left, carrying the dress.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001657": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001657",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001658": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001658",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nThere, I can’t see anything more to mend now. Would you like to try it on—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001659": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001659",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001660": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001660",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[in a hoarse whisper]</i>. Christine, come here.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001661": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001661",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001662": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001662",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[throwing the dress down on the sofa]</i>. What is the matter with you? You look so agitated!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001663": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001663",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001664": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001664",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nCome here. Do you see that letter? There, look—you can see it through the glass in the letter-box.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001665": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001665",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001666": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001666",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, I see it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001667": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001667",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001668": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001668",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThat letter is from Krogstad.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001669": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001669",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001670": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001670",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNora—it was Krogstad who lent you the money!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001671": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001671",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001672": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001672",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, and now Torvald will know all about it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001673": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001673",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001674": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001674",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBelieve me, Nora, that’s the best thing for both of you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001675": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001675",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001676": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001676",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou don’t know all. I forged a name.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001677": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001677",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001678": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001678",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nGood heavens—!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001679": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001679",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001680": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001680",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI only want to say this to you, Christine—you must be my witness.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001681": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001681",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001682": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001682",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYour witness? What do you mean? What am I to—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001683": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001683",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001684": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001684",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIf I should go out of my mind—and it might easily happen—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001685": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001685",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001686": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001686",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNora!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001687": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001687",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001688": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001688",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOr if anything else should happen to me—anything, for instance, that might prevent my being here—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001689": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001689",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001690": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001690",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNora! Nora! you are quite out of your mind.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001691": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001691",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001692": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001692",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd if it should happen that there were some one who wanted to take all the responsibility, all the blame, you understand—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001693": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001693",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001694": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001694",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, yes—but how can you suppose—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001695": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001695",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001696": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001696",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThen you must be my witness, that it is not true, Christine. I am not out of my mind at all; I am in my right senses now, and I tell you no one else has known anything about it; I, and I alone, did the whole thing. Remember that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001697": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001697",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001698": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001698",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI will, indeed. But I don’t understand all this.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001699": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001699",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001700": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001700",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHow should you understand it? A wonderful thing is going to happen!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001701": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001701",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001702": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001702",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nA wonderful thing?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001703": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001703",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001704": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001704",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, a wonderful thing!—But it is so terrible, Christine; it mustn’t happen, not for all the world.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001705": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001705",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001706": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001706",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI will go at once and see Krogstad.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001707": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001707",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001708": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001708",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDon’t go to him; he will do you some harm.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001709": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001709",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001710": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001710",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nThere was a time when he would gladly do anything for my sake.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001711": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001711",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001712": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001712",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHe?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001713": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001713",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001714": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001714",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWhere does he live?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001715": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001715",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001716": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001716",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHow should I know—? Yes <i>[feeling in her pocket]</i>, here is his card. But the letter, the letter—!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001717": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001717",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001718": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001718",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[calls from his room, knocking at the door]</i>. Nora! Nora <i>[cries out anxiously]</i>. Oh, what’s that? What do you want?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001719": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001719",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001720": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001720",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nDon’t be so frightened. We are not coming in; you have locked the door. Are you trying on your dress?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001721": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001721",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001722": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001722",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, that’s it. I look so nice, Torvald.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001723": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001723",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001724": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001724",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[who has read the card]</i>. I see he lives at the corner here.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001725": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001725",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001726": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001726",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, but it’s no use. It is hopeless. The letter is lying there in the box.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001727": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001727",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001728": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001728",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nAnd your husband keeps the key?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001729": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001729",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001730": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001730",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, always.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001731": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001731",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001732": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001732",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nKrogstad must ask for his letter back unread, he must find some pretence—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001733": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001733",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001734": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001734",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBut it is just at this time that Torvald generally—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001735": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001735",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001736": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001736",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYou must delay him. Go in to him in the meantime. I will come back as soon as I can. <i>[She goes out hurriedly through the hall door.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001737": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001737",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001738": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001738",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[goes to HELMER’S door, opens it and peeps in]</i>. Torvald!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001739": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001739",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001740": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001740",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[from the inner room]</i>. Well? May I venture at last to come into my own room again? Come along, Rank, now you will see— <i>[Halting in the doorway.]</i> But what is this?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001741": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001741",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001742": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001742",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat is what, dear?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001743": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001743",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001744": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001744",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nRank led me to expect a splendid transformation.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001745": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001745",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001746": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001746",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[in the doorway]</i>. I understood so, but evidently I was mistaken.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001747": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001747",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001748": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001748",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, nobody is to have the chance of admiring me in my dress until tomorrow.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001749": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001749",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001750": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001750",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut, my dear Nora, you look so worn out. Have you been practising too much?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001751": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001751",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001752": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001752",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, I have not practised at all.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001753": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001753",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001754": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001754",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut you will need to—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001755": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001755",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001756": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001756",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, indeed I shall, Torvald. But I can’t get on a bit without you to help me; I have absolutely forgotten the whole thing.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001757": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001757",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001758": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001758",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nOh, we will soon work it up again.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001759": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001759",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001760": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001760",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, help me, Torvald. Promise that you will! I am so nervous about it—all the people—. You must give yourself up to me entirely this evening. Not the tiniest bit of business—you mustn’t even take a pen in your hand. Will you promise, Torvald dear?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001761": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001761",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001762": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001762",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nI promise. This evening I will be wholly and absolutely at your service, you helpless little mortal. Ah, by the way, first of all I will just— <i>[Goes towards the hall door.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001763": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001763",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001764": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001764",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat are you going to do there?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001765": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001765",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001766": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001766",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nOnly see if any letters have come.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001767": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001767",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001768": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001768",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, no! don’t do that, Torvald!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001769": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001769",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001770": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001770",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhy not?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001771": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001771",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001772": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001772",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nTorvald, please don’t. There is nothing there.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001773": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001773",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001774": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001774",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWell, let me look. <i>[Turns to go to the letter-box. NORA, at the piano, plays the first bars of the Tarantella. HELMER stops in the doorway.]</i> Aha!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001775": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001775",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001776": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001776",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI can’t dance tomorrow if I don’t practise with you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001777": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001777",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001778": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001778",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[going up to her]</i>. Are you really so afraid of it, dear?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001779": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001779",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001780": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001780",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, so dreadfully afraid of it. Let me practise at once; there is time now, before we go to dinner. Sit down and play for me, Torvald dear; criticise me, and correct me as you play.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001781": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001781",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001782": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001782",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWith great pleasure, if you wish me to. <i>[Sits down at the piano.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001783": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001783",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001784": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001784",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[takes out of the box a tambourine and a long variegated shawl. She hastily drapes the shawl round her. Then she springs to the front of the stage and calls out]</i>. Now play for me! I am going to dance!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001785": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001785",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001786": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001786",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[HELMER plays and NORA dances. RANK stands by the piano behind HELMER, and looks on.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001787": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001787",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001788": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001788",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[as he plays]</i>. Slower, slower!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001789": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001789",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001790": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001790",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI can’t do it any other way.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001791": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001791",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001792": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001792",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNot so violently, Nora!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001793": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001793",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001794": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001794",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThis is the way.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001795": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001795",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001796": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001796",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[stops playing]</i>. No, no—that is not a bit right.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001797": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001797",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001798": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001798",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[laughing and swinging the tambourine]</i>. Didn’t I tell you so?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001799": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001799",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001800": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001800",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nLet me play for her.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001801": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001801",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001802": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001802",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[getting up]</i>. Yes, do. I can correct her better then.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001803": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001803",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001804": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001804",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[RANK sits down at the piano and plays. NORA dances more and more wildly. HELMER has taken up a position beside the stove, and during her dance gives her frequent instructions. She does not seem to hear him; her hair comes down and falls over her shoulders; she pays no attention to it, but goes on dancing. Enter Mrs Linde.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001805": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001805",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001806": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001806",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[standing as if spell-bound in the doorway]</i>. Oh!—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001807": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001807",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001808": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001808",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[as she dances]</i>. Such fun, Christine!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001809": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001809",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001810": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001810",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nMy dear darling Nora, you are dancing as if your life depended on it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001811": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001811",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001812": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001812",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nSo it does.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001813": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001813",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001814": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001814",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nStop, Rank; this is sheer madness. Stop, I tell you! <i>[RANK stops playing, and NORA suddenly stands still. HELMER goes up to her.]</i> I could never have believed it. You have forgotten everything I taught you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001815": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001815",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001816": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001816",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[throwing away the tambourine]</i>. There, you see.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001817": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001817",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001818": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001818",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou will want a lot of coaching.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001819": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001819",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001820": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001820",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, you see how much I need it. You must coach me up to the last minute. Promise me that, Torvald!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001821": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001821",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001822": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001822",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou can depend on me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001823": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001823",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001824": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001824",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou must not think of anything but me, either today or tomorrow; you mustn’t open a single letter—not even open the letter-box—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001825": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001825",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001826": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001826",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAh, you are still afraid of that fellow—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001827": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001827",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001828": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001828",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, indeed I am.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001829": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001829",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001830": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001830",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora, I can tell from your looks that there is a letter from him lying there.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001831": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001831",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001832": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001832",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI don’t know; I think there is; but you must not read anything of that kind now. Nothing horrid must come between us until this is all over.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001833": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001833",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001834": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001834",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[whispers to HELMER]</i>. You mustn’t contradict her.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001835": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001835",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001836": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001836",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[taking her in his arms]</i>. The child shall have her way. But tomorrow night, after you have danced—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001837": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001837",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001838": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001838",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThen you will be free. <i>[The MAID appears in the doorway to the right.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001839": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001839",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001840": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001840",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\nDinner is served, ma’am.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001841": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001841",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001842": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001842",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWe will have champagne, Helen.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001843": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001843",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001844": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001844",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\nVery good, ma’am. [Exit.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001845": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001845",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001846": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001846",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nHullo!—are we going to have a banquet?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001847": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001847",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001848": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001848",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, a champagne banquet until the small hours. <i>[Calls out.]</i> And a few macaroons, Helen—lots, just for once!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001849": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001849",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001850": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001850",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nCome, come, don’t be so wild and nervous. Be my own little skylark, as you used.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001851": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001851",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001852": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001852",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, dear, I will. But go in now and you too, Doctor Rank. Christine, you must help me to do up my hair.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001853": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001853",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001854": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001854",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[whispers to HELMER as they go out]</i>. I suppose there is nothing—she is not expecting anything?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001855": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001855",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001856": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001856",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nFar from it, my dear fellow; it is simply nothing more than this childish nervousness I was telling you of. <i>[They go into the right-hand room.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001857": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001857",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001858": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001858",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWell!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001859": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001859",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001860": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001860",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nGone out of town.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001861": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001861",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001862": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001862",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI could tell from your face.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001863": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001863",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001864": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001864",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nHe is coming home tomorrow evening. I wrote a note for him.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001865": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001865",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001866": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001866",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou should have let it alone; you must prevent nothing. After all, it is splendid to be waiting for a wonderful thing to happen.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001867": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001867",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001868": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001868",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWhat is it that you are waiting for?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001869": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001869",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001870": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001870",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOh, you wouldn’t understand. Go in to them, I will come in a moment. <i>[Mrs Linde goes into the dining-room. NORA stands still for a little while, as if to compose herself. Then she looks at her watch.]</i> Five o’clock. Seven hours until midnight; and then four-and-twenty hours until the next midnight. Then the Tarantella will be over. Twenty-four and seven? Thirty-one hours to live.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001871": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001871",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001872": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001872",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[from the doorway on the right]</i>. Where’s my little skylark?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001873": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001873",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001874": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001874",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[going to him with her arms outstretched]</i>. Here she is!<br>\n<br></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001875": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001875",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001876": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001876",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001877": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001877",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><h2><a></a>ACT III</h2></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001878": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001878",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001879": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001879",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[THE SAME SCENE.—The table has been placed in the middle of the stage, with chairs around it. A lamp is burning on the table. The door into the hall stands open. Dance music is heard in the room above. Mrs Linde is sitting at the table idly turning over the leaves of a book; she tries to read, but does not seem able to collect her thoughts. Every now and then she listens intently for a sound at the outer door.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001880": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001880",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001881": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001881",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[looking at her watch]</i>. Not yet—and the time is nearly up. If only he does not—. <i>[Listens again.]</i> Ah, there he is. <i>[Goes into the hall and opens the outer door carefully. Light footsteps are heard on the stairs. She whispers.]</i> Come in. There is no one here.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001882": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001882",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001883": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001883",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\n<i>[in the doorway]</i>. I found a note from you at home. What does this mean?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001884": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001884",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001885": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001885",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nIt is absolutely necessary that I should have a talk with you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001886": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001886",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001887": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001887",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nReally? And is it absolutely necessary that it should be here?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001888": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001888",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001889": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001889",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nIt is impossible where I live; there is no private entrance to my rooms. Come in; we are quite alone. The maid is asleep, and the Helmers are at the dance upstairs.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001890": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001890",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001891": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001891",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\n<i>[coming into the room]</i>. Are the Helmers really at a dance tonight?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001892": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001892",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001893": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001893",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, why not?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001894": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001894",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001895": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001895",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nCertainly—why not?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001896": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001896",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001897": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001897",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNow, Nils, let us have a talk.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001898": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001898",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001899": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001899",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nCan we two have anything to talk about?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001900": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001900",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001901": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001901",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWe have a great deal to talk about.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001902": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001902",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001903": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001903",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI shouldn’t have thought so.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001904": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001904",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001905": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001905",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo, you have never properly understood me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001906": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001906",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001907": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001907",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nWas there anything else to understand except what was obvious to all the world—a heartless woman jilts a man when a more lucrative chance turns up?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001908": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001908",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001909": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001909",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nDo you believe I am as absolutely heartless as all that? And do you believe that I did it with a light heart?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001910": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001910",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001911": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001911",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nDidn’t you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001912": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001912",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001913": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001913",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNils, did you really think that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001914": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001914",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001915": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001915",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nIf it were as you say, why did you write to me as you did at the time?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001916": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001916",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001917": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001917",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI could do nothing else. As I had to break with you, it was my duty also to put an end to all that you felt for me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001918": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001918",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001919": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001919",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\n<i>[wringing his hands]</i>. So that was it. And all this—only for the sake of money!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001920": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001920",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001921": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001921",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYou must not forget that I had a helpless mother and two little brothers. We couldn’t wait for you, Nils; your prospects seemed hopeless then.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001922": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001922",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001923": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001923",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nThat may be so, but you had no right to throw me over for anyone else’s sake.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001924": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001924",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001925": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001925",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nIndeed I don’t know. Many a time did I ask myself if I had the right to do it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001926": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001926",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001927": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001927",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\n<i>[more gently]</i>. When I lost you, it was as if all the solid ground went from under my feet. Look at me now—I am a shipwrecked man clinging to a bit of wreckage.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001928": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001928",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001929": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001929",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nBut help may be near.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001930": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001930",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001931": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001931",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nIt was near; but then you came and stood in my way.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001932": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001932",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001933": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001933",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nUnintentionally, Nils. It was only today that I learned it was your place I was going to take in the Bank.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001934": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001934",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001935": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001935",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI believe you, if you say so. But now that you know it, are you not going to give it up to me?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001936": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001936",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001937": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001937",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo, because that would not benefit you in the least.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001938": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001938",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001939": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001939",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nOh, benefit, benefit—I would have done it whether or no.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001940": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001940",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001941": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001941",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI have learned to act prudently. Life, and hard, bitter necessity have taught me that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001942": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001942",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001943": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001943",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nAnd life has taught me not to believe in fine speeches.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001944": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001944",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001945": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001945",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nThen life has taught you something very reasonable. But deeds you must believe in?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001946": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001946",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001947": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001947",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nWhat do you mean by that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001948": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001948",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001949": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001949",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYou said you were like a shipwrecked man clinging to some wreckage.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001950": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001950",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001951": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001951",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI had good reason to say so.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001952": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001952",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001953": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001953",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWell, I am like a shipwrecked woman clinging to some wreckage—no one to mourn for, no one to care for.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001954": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001954",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001955": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001955",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nIt was your own choice.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001956": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001956",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001957": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001957",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nThere was no other choice—then.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001958": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001958",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001959": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001959",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nWell, what now?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001960": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001960",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001961": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001961",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNils, how would it be if we two shipwrecked people could join forces?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001962": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001962",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001963": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001963",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nWhat are you saying?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001964": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001964",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001965": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001965",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nTwo on the same piece of wreckage would stand a better chance than each on their own.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001966": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001966",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001967": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001967",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nChristine I...</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001968": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001968",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001969": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001969",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWhat do you suppose brought me to town?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001970": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001970",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001971": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001971",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nDo you mean that you gave me a thought?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001972": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001972",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001973": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001973",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI could not endure life without work. All my life, as long as I can remember, I have worked, and it has been my greatest and only pleasure. But now I am quite alone in the world—my life is so dreadfully empty and I feel so forsaken. There is not the least pleasure in working for one’s self. Nils, give me someone and something to work for.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001974": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001974",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001975": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001975",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI don’t trust that. It is nothing but a woman’s overstrained sense of generosity that prompts you to make such an offer of yourself.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001976": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001976",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001977": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001977",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nHave you ever noticed anything of the sort in me?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001978": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001978",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001979": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001979",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nCould you really do it? Tell me—do you know all about my past life?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001980": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001980",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001981": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001981",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001982": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001982",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001983": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001983",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nAnd do you know what they think of me here?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001984": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001984",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001985": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001985",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYou seemed to me to imply that with me you might have been quite another man.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001986": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001986",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001987": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001987",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI am certain of it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001988": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001988",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001989": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001989",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nIs it too late now?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001990": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001990",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001991": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001991",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nChristine, are you saying this deliberately? Yes, I am sure you are. I see it in your face. Have you really the courage, then—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001992": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001992",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001993": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001993",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI want to be a mother to someone, and your children need a mother. We two need each other. Nils, I have faith in your real character—I can dare anything together with you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001994": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001994",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001995": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001995",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\n<i>[grasps her hands]</i>. Thanks, thanks, Christine! Now I shall find a way to clear myself in the eyes of the world. Ah, but I forgot—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001996": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001996",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001997": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001997",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[listening]</i>. Hush! The Tarantella! Go, go!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001998": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001998",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000001999": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000001999",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nWhy? What is it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002000": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002000",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002001": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002001",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nDo you hear them up there? When that is over, we may expect them back.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002002": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002002",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002003": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002003",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nYes, yes—I will go. But it is all no use. Of course you are not aware what steps I have taken in the matter of the Helmers.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002004": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002004",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002005": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002005",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, I know all about that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002006": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002006",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002007": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002007",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nAnd in spite of that have you the courage to—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002008": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002008",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002009": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002009",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nI understand very well to what lengths a man like you might be driven by despair.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002010": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002010",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002011": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002011",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nIf I could only undo what I have done!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002012": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002012",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002013": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002013",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYou cannot. Your letter is lying in the letter-box now.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002014": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002014",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002015": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002015",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nAre you sure of that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002016": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002016",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002017": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002017",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nQuite sure, but—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002018": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002018",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002019": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002019",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\n<i>[with a searching look at her]</i>. Is that what it all means?—that you want to save your friend at any cost? Tell me frankly. Is that it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002020": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002020",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002021": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002021",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNils, a woman who has once sold herself for another’s sake, doesn’t do it a second time.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002022": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002022",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002023": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002023",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI will ask for my letter back.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002024": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002024",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002025": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002025",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo, no.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002026": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002026",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002027": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002027",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nYes, of course I will. I will wait here until Helmer comes; I will tell him he must give me my letter back—that it only concerns my dismissal—that he is not to read it—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002028": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002028",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002029": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002029",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNo, Nils, you must not recall your letter.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002030": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002030",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002031": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002031",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nBut, tell me, wasn’t it for that very purpose that you asked me to meet you here?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002032": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002032",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002033": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002033",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nIn my first moment of fright, it was. But twenty-four hours have elapsed since then, and in that time I have witnessed incredible things in this house. Helmer must know all about it. This unhappy secret must be disclosed; they must have a complete understanding between them, which is impossible with all this concealment and falsehood going on.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002034": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002034",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002035": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002035",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nVery well, if you will take the responsibility. But there is one thing I can do in any case, and I shall do it at once.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002036": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002036",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002037": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002037",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[listening]</i>. You must be quick and go! The dance is over; we are not safe a moment longer.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002038": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002038",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002039": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002039",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI will wait for you below.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002040": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002040",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002041": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002041",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, do. You must see me back to my door...</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002042": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002042",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002043": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002043",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">KROGSTAD.<br>\nI have never had such an amazing piece of good fortune in my life! <i>[Goes out through the outer door. The door between the room and the hall remains open.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002044": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002044",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002045": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002045",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[tidying up the room and laying her hat and cloak ready]</i>. What a difference! what a difference! Someone to work for and live for—a home to bring comfort into. That I will do, indeed. I wish they would be quick and come—<i>[Listens.]</i> Ah, there they are now. I must put on my things. <i>[Takes up her hat and cloak. HELMER’S and NORA’S voices are heard outside; a key is turned, and HELMER brings NORA almost by force into the hall. She is in an Italian costume with a large black shawl around her; he is in evening dress, and a black domino which is flying open.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002046": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002046",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002047": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002047",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[hanging back in the doorway, and struggling with him]</i>. No, no, no!—don’t take me in. I want to go upstairs again; I don’t want to leave so early.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002048": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002048",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002049": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002049",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut, my dearest Nora—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002050": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002050",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002051": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002051",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nPlease, Torvald dear—please, please—only an hour more.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002052": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002052",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002053": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002053",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNot a single minute, my sweet Nora. You know that was our agreement. Come along into the room; you are catching cold standing there. <i>[He brings her gently into the room, in spite of her resistance.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002054": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002054",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002055": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002055",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nGood evening.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002056": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002056",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002057": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002057",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nChristine!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002058": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002058",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002059": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002059",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou here, so late, Mrs Linde?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002060": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002060",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002061": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002061",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, you must excuse me; I was so anxious to see Nora in her dress.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002062": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002062",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002063": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002063",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHave you been sitting here waiting for me?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002064": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002064",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002065": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002065",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, unfortunately I came too late, you had already gone upstairs; and I thought I couldn’t go away again without having seen you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002066": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002066",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002067": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002067",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[taking off NORA’S shawl]</i>. Yes, take a good look at her. I think she is worth looking at. Isn’t she charming, Mrs Linde?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002068": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002068",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002069": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002069",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, indeed she is.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002070": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002070",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002071": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002071",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nDoesn’t she look remarkably pretty? Everyone thought so at the dance. But she is terribly self-willed, this sweet little person. What are we to do with her? You will hardly believe that I had almost to bring her away by force.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002072": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002072",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002073": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002073",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nTorvald, you will repent not having let me stay, even if it were only for half an hour.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002074": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002074",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002075": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002075",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nListen to her, Mrs Linde! She had danced her Tarantella, and it had been a tremendous success, as it deserved—although possibly the performance was a trifle too realistic—a little more so, I mean, than was strictly compatible with the limitations of art. But never mind about that! The chief thing is, she had made a success—she had made a tremendous success. Do you think I was going to let her remain there after that, and spoil the effect? No, indeed! I took my charming little Capri maiden—my capricious little Capri maiden, I should say—on my arm; took one quick turn round the room; a curtsey on either side, and, as they say in novels, the beautiful apparition disappeared. An exit ought always to be effective, Mrs Linde; but that is what I cannot make Nora understand. Pooh! this room is hot. <i>[Throws his domino on a chair, and opens the door of his room.]</i> Hullo! it’s all dark in here. Oh, of course—excuse me—. <i>[He goes in, and lights some candles.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002076": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002076",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002077": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002077",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[in a hurried and breathless whisper]</i>. Well?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002078": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002078",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002079": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002079",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[in a low voice]</i>. I have had a talk with him.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002080": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002080",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002081": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002081",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, and—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002082": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002082",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002083": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002083",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nNora, you must tell your husband all about it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002084": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002084",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002085": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002085",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[in an expressionless voice]</i>. I knew it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002086": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002086",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002087": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002087",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYou have nothing to be afraid of as far as Krogstad is concerned; but you must tell him.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002088": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002088",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002089": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002089",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI won’t tell him.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002090": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002090",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002091": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002091",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nThen the letter will.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002092": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002093": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002093",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThank you, Christine. Now I know what I must do. Hush—!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002094": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002094",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002095": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002095",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[coming in again]</i>. Well, Mrs Linde, have you admired her?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002096": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002096",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002097": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002097",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, and now I will say goodnight.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002098": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002098",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002099": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002099",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat, already? Is this yours, this knitting?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002100": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002100",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002101": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002101",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\n<i>[taking it]</i>. Yes, thank you, I had very nearly forgotten it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002102": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002102",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002103": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002103",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nSo you knit?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002104": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002104",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002105": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002105",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nOf course.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002106": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002106",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002107": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002107",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nDo you know, you ought to embroider.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002108": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002108",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002109": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nReally? Why?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002110": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002110",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002111": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002111",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes, it’s far more becoming. Let me show you. You hold the embroidery thus in your left hand, and use the needle with the right—like this—with a long, easy sweep. Do you see?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002112": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002113": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nYes, perhaps—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002114": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002114",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002115": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002115",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut in the case of knitting—that can never be anything but ungraceful; look here—the arms close together, the knitting-needles going up and down—it has a sort of Chinese effect—. That was really excellent champagne they gave us.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002116": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002116",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002117": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002117",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nWell,—goodnight, Nora, and don’t be self-willed any more.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002118": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002118",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002119": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002119",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThat’s right, Mrs Linde.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002120": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002120",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002121": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002121",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MRS LINDE.<br>\nGoodnight, Mr. Helmer.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002122": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002122",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002123": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002123",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[accompanying her to the door]</i>. Goodnight, goodnight. I hope you will get home all right. I should be very happy to—but you haven’t any great distance to go. Goodnight, goodnight. <i>[She goes out; he shuts the door after her, and comes in again.]</i> Ah!—at last we have got rid of her. She is a frightful bore, that woman.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002124": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002124",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002125": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002125",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAren’t you very tired, Torvald?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002126": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002126",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002127": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002127",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNo, not in the least.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002128": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002128",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002129": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002129",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNor sleepy?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002130": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002130",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002131": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002131",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNot a bit. On the contrary, I feel extraordinarily lively. And you?—you really look both tired and sleepy.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002132": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002132",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002133": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002133",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, I am very tired. I want to go to sleep at once.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002134": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002134",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002135": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002135",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThere, you see it was quite right of me not to let you stay there any longer.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002136": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002136",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002137": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002137",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nEverything you do is quite right, Torvald.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002138": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002138",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002139": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002139",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[kissing her on the forehead]</i>. Now my little skylark is speaking reasonably. Did you notice what good spirits Rank was in this evening?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002140": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002140",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002141": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002141",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nReally? Was he? I didn’t speak to him at all.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002142": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002142",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002143": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002143",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd I very little, but I have not for a long time seen him in such good form. <i>[Looks for a while at her and then goes nearer to her.]</i> It is delightful to be at home by ourselves again, to be all alone with you—you fascinating, charming little darling!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002144": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002144",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002145": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002145",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDon’t look at me like that, Torvald.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002146": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002146",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002147": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002147",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhy shouldn’t I look at my dearest treasure?—at all the beauty that is mine, all my very own?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002148": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002148",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002149": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002149",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[going to the other side of the table]</i>. You mustn’t say things like that to me tonight.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002150": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002150",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002151": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002151",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[following her]</i>. You have still got the Tarantella in your blood, I see. And it makes you more captivating than ever. Listen—the guests are beginning to go now. <i>[In a lower voice.]</i> Nora—soon the whole house will be quiet.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002152": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002152",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002153": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002153",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, I hope so.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002154": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002154",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002155": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002155",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes, my own darling Nora. Do you know, when I am out at a party with you like this, why I speak so little to you, keep away from you, and only send a stolen glance in your direction now and then?—do you know why I do that? It is because I make believe to myself that we are secretly in love, and you are my secretly promised bride, and that no one suspects there is anything between us.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002156": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002156",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002157": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002157",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, yes—I know very well your thoughts are with me all the time.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002158": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002158",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002159": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002159",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd when we are leaving, and I am putting the shawl over your beautiful young shoulders—on your lovely neck—then I imagine that you are my young bride and that we have just come from the wedding, and I am bringing you for the first time into our home—to be alone with you for the first time—quite alone with my shy little darling! All this evening I have longed for nothing but you. When I watched the seductive figures of the Tarantella, my blood was on fire; I could endure it no longer, and that was why I brought you down so early—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002160": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002160",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002161": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002161",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nGo away, Torvald! You must let me go. I won’t—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002162": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002162",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002163": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002163",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat’s that? You’re joking, my little Nora! You won’t—you won’t? Am I not your husband—? <i>[A knock is heard at the outer door.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002164": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002164",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002165": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002165",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[starting]</i>. Did you hear—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002166": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002166",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002167": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002167",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[going into the hall]</i>. Who is it?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002168": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002168",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002169": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002169",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[outside]</i>. It is I. May I come in for a moment?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002170": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002170",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002171": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002171",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[in a fretful whisper]</i>. Oh, what does he want now? <i>[Aloud.]</i> Wait a minute! <i>[Unlocks the door.]</i> Come, that’s kind of you not to pass by our door.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002172": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002172",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002173": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002173",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nI thought I heard your voice, and felt as if I should like to look in. <i>[With a swift glance round.]</i> Ah, yes!—these dear familiar rooms. You are very happy and cosy in here, you two.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002174": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002174",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002175": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002175",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nIt seems to me that you looked after yourself pretty well upstairs too.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002176": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002176",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002177": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002177",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nExcellently. Why shouldn’t I? Why shouldn’t one enjoy everything in this world?—at any rate as much as one can, and as long as one can. The wine was capital—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002178": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002178",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002179": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002179",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nEspecially the champagne.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002180": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002180",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002181": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002181",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nSo you noticed that too? It is almost incredible how much I managed to put away!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002182": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002182",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002183": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002183",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nTorvald drank a great deal of champagne tonight too.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002184": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002184",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002185": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002185",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nDid he?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002186": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002186",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002187": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002187",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, and he is always in such good spirits afterwards.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002188": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002188",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002189": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002189",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWell, why should one not enjoy a merry evening after a well-spent day?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002190": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002190",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002191": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002191",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWell spent? I am afraid I can’t take credit for that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002192": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002192",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002193": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002193",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[clapping him on the back]</i>. But I can, you know!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002194": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002194",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002195": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002195",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDoctor Rank, you must have been occupied with some scientific investigation today.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002196": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002196",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002197": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002197",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nExactly.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002198": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002198",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002199": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002199",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nJust listen!—little Nora talking about scientific investigations!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002200": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002200",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002201": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002201",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd may I congratulate you on the result?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002202": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002202",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002203": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002203",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nIndeed you may.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002204": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002204",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002205": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002205",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWas it favourable, then?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002206": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002206",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002207": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002207",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nThe best possible, for both doctor and patient—certainty.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002208": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002208",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002209": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002209",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[quickly and searchingly]</i>. Certainty?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002210": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002210",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002211": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002211",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nAbsolute certainty. So wasn’t I entitled to make a merry evening of it after that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002212": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002212",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002213": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002213",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, you certainly were, Doctor Rank.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002214": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002214",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002215": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002215",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nI think so too, so long as you don’t have to pay for it in the morning.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002216": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002216",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002217": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002217",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nOh well, one can’t have anything in this life without paying for it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002218": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002218",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002219": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002219",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDoctor Rank—are you fond of fancy-dress balls?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002220": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002220",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002221": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002221",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nYes, if there is a fine lot of pretty costumes.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002222": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002222",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002223": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002223",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nTell me—what shall we two wear at the next?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002224": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002224",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002225": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002225",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nLittle featherbrain!—are you thinking of the next already?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002226": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002226",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002227": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002227",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nWe two? Yes, I can tell you. You shall go as a good fairy—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002228": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002228",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002229": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002229",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes, but what do you suggest as an appropriate costume for that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002230": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002230",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002231": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002231",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nLet your wife go dressed just as she is in everyday life.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002232": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002232",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002233": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002233",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThat was really very prettily turned. But can’t you tell us what you will be?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002234": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002234",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002235": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002235",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nYes, my dear friend, I have quite made up my mind about that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002236": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002236",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002237": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002237",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWell?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002238": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002238",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002239": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002239",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nAt the next fancy-dress ball I shall be invisible.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002240": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002240",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002241": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002241",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThat’s a good joke!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002242": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002242",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002243": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002243",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nThere is a big black hat—have you never heard of hats that make you invisible? If you put one on, no one can see you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002244": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002244",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002245": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002245",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[suppressing a smile]</i>. Yes, you are quite right.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002246": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002246",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002247": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002247",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nBut I am clean forgetting what I came for. Helmer, give me a cigar—one of the dark Havanas.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002248": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002248",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002249": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002249",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWith the greatest pleasure. <i>[Offers him his case.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002250": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002250",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002251": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002251",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\n<i>[takes a cigar and cuts off the end]</i>. Thanks.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002252": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002252",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002253": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002253",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[striking a match]</i>. Let me give you a light.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002254": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002254",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002255": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002255",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nThank you. <i>[She holds the match for him to light his cigar.]</i> And now goodbye!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002256": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002256",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002257": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002257",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nGoodbye, goodbye, dear old man!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002258": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002258",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002259": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002259",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nSleep well, Doctor Rank.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002260": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002260",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002261": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002261",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nThank you for that wish.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002262": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002262",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002263": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002263",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWish me the same.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002264": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002264",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002265": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002265",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">RANK.<br>\nYou? Well, if you want me to sleep well! And thanks for the light. <i>[He nods to them both and goes out.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002266": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002266",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002267": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002267",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[in a subdued voice]</i>. He has drunk more than he ought.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002268": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002268",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002269": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002269",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[absently]</i>. Maybe. <i>[HELMER takes a bunch of keys out of his pocket and goes into the hall.]</i> Torvald! what are you going to do there?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002270": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002270",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002271": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002271",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nEmptying the letter-box; it is quite full; there will be no room to put the newspaper in tomorrow morning.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002272": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002272",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002273": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002273",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAre you going to work tonight?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002274": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002274",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002275": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002275",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou know quite well I’m not. What is this? Someone has been at the lock.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002276": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002276",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002277": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002277",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAt the lock—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002278": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002278",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002279": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002279",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes, someone has. What can it mean? I should never have thought the maid—. Here is a broken hairpin. Nora, it is one of yours.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002280": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002280",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002281": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002281",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[quickly]</i>. Then it must have been the children—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002282": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002282",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002283": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002283",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThen you must get them out of those ways. There, at last I have got it open. <i>[Takes out the contents of the letter-box, and calls to the kitchen.]</i> Helen!—Helen, put out the light over the front door. <i>[Goes back into the room and shuts the door into the hall. He holds out his hand full of letters.]</i> Look at that—look what a heap of them there are. <i>[Turning them over.]</i> What on earth is that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002284": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002284",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002285": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002285",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[at the window]</i>. The letter—No! Torvald, no!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002286": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002286",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002287": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002287",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nTwo cards—of Rank’s.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002288": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002288",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002289": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002289",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nOf Doctor Rank’s?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002290": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002290",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002291": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002291",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[looking at them]</i>. Doctor Rank. They were on the top. He must have put them in when he went out.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002292": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002292",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002293": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002293",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIs there anything written on them?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002294": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002294",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002295": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002295",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThere is a black cross over the name. Look there—what an uncomfortable idea! It looks as if he were announcing his own death.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002296": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002296",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002297": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002297",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt is just what he is doing.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002298": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002298",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002299": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002299",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat? Do you know anything about it? Has he said anything to you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002300": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002300",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002301": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002301",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes. He told me that when the cards came it would be his leave-taking from us. He means to shut himself up and die.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002302": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002302",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002303": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002303",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nMy poor old friend! Certainly I knew we should not have him very long with us. But so soon! And so he hides himself away like a wounded animal.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002304": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002304",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002305": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002305",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIf it has to happen, it is best it should be without a word—don’t you think so, Torvald?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002306": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002306",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002307": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002307",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[walking up and down]</i>. He had so grown into our lives. I can’t think of him as having gone out of them. He, with his sufferings and his loneliness, was like a cloudy background to our sunlit happiness. Well, perhaps it is best so. For him, anyway. <i>[Standing still.]</i> And perhaps for us too, Nora. We two are thrown quite upon each other now. <i>[Puts his arms round her.]</i> My darling wife, I don’t feel as if I could hold you tight enough. Do you know, Nora, I have often wished that you might be threatened by some great danger, so that I might risk my life’s blood, and everything, for your sake.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002308": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002308",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002309": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002309",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[disengages herself, and says firmly and decidedly]</i>. Now you must read your letters, Torvald.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002310": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002310",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002311": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002311",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNo, no; not tonight. I want to be with you, my darling wife.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002312": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002312",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002313": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002313",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWith the thought of your friend’s death—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002314": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002314",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002315": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002315",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou are right, it has affected us both. Something ugly has come between us—the thought of the horrors of death. We must try and rid our minds of that. Until then—we will each go to our own room.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002316": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002316",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002317": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002317",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[hanging on his neck]</i>. Goodnight, Torvald—Goodnight!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002318": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002318",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002319": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002319",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[kissing her on the forehead]</i>. Goodnight, my little singing-bird. Sleep sound, Nora. Now I will read my letters through. <i>[He takes his letters and goes into his room, shutting the door after him.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002320": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002320",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002321": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002321",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[gropes distractedly about, seizes HELMER’S domino, throws it round her, while she says in quick, hoarse, spasmodic whispers]</i>. Never to see him again. Never! Never! <i>[Puts her shawl over her head.]</i> Never to see my children again either—never again. Never! Never!—Ah! the icy, black water—the unfathomable depths—If only it were over! He has got it now—now he is reading it. Goodbye, Torvald and my children! <i>[She is about to rush out through the hall, when HELMER opens his door hurriedly and stands with an open letter in his hand.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002322": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002322",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002323": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002323",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002324": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002324",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002325": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002325",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAh!—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002326": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002326",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002327": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002327",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat is this? Do you know what is in this letter?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002328": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002328",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002329": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002329",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, I know. Let me go! Let me get out!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002330": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002330",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002331": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002331",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[holding her back]</i>. Where are you going?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002332": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002332",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002333": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002333",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[trying to get free]</i>. You shan’t save me, Torvald!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002334": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002334",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002335": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002335",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[reeling]</i>. True? Is this true, that I read here? Horrible! No, no—it is impossible that it can be true.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002336": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002336",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002337": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002337",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt is true. I have loved you above everything else in the world.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002338": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002338",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002339": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002339",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nOh, don’t let us have any silly excuses.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002340": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002340",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002341": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002341",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[taking a step towards him]</i>. Torvald—!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002342": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002342",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002343": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002343",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nMiserable creature—what have you done?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002344": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002344",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002345": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002345",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nLet me go. You shall not suffer for my sake. You shall not take it upon yourself.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002346": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002346",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002347": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002347",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNo tragic airs, please. <i>[Locks the hall door.]</i> Here you shall stay and give me an explanation. Do you understand what you have done? Answer me! Do you understand what you have done?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002348": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002348",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002349": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002349",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[looks steadily at him and says with a growing look of coldness in her face]</i>. Yes, now I am beginning to understand thoroughly.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002350": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002350",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002351": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002351",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[walking about the room]</i>. What a horrible awakening! All these eight years—she who was my joy and pride—a hypocrite, a liar—worse, worse—a criminal! The unutterable ugliness of it all!—For shame! For shame! <i>[NORA is silent and looks steadily at him. He stops in front of her.]</i> I ought to have suspected that something of the sort would happen. I ought to have foreseen it. All your father’s want of principle—be silent!—all your father’s want of principle has come out in you. No religion, no morality, no sense of duty—. How I am punished for having winked at what he did! I did it for your sake, and this is how you repay me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002352": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002352",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002353": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002353",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, that’s just it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002354": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002354",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002355": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002355",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNow you have destroyed all my happiness. You have ruined all my future. It is horrible to think of! I am in the power of an unscrupulous man; he can do what he likes with me, ask anything he likes of me, give me any orders he pleases—I dare not refuse. And I must sink to such miserable depths because of a thoughtless woman!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002356": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002356",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002357": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002357",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhen I am out of the way, you will be free.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002358": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002358",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002359": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002359",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNo fine speeches, please. Your father had always plenty of those ready, too. What good would it be to me if you were out of the way, as you say? Not the slightest. He can make the affair known everywhere; and if he does, I may be falsely suspected of having been a party to your criminal action. Very likely people will think I was behind it all—that it was I who prompted you! And I have to thank you for all this—you whom I have cherished during the whole of our married life. Do you understand now what it is you have done for me?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002360": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002360",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002361": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002361",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[coldly and quietly]</i>. Yes.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002362": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002362",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002363": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002363",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nIt is so incredible that I can’t take it in. But we must come to some understanding. Take off that shawl. Take it off, I tell you. I must try and appease him some way or another. The matter must be hushed up at any cost. And as for you and me, it must appear as if everything between us were just as before—but naturally only in the eyes of the world. You will still remain in my house, that is a matter of course. But I shall not allow you to bring up the children; I dare not trust them to you. To think that I should be obliged to say so to one whom I have loved so dearly, and whom I still—. No, that is all over. From this moment happiness is not the question; all that concerns us is to save the remains, the fragments, the appearance—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002364": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002364",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002365": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002365",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[A ring is heard at the front-door bell.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002366": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002366",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002367": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002367",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[with a start]</i>. What is that? So late! Can the worst—? Can he—? Hide yourself, Nora. Say you are ill.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002368": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002368",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002369": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002369",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[NORA stands motionless. HELMER goes and unlocks the hall door.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002370": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002370",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002371": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002371",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">MAID.<br>\n<i>[half-dressed, comes to the door]</i>. A letter for the mistress.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002372": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002372",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002373": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002373",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nGive it to me. <i>[Takes the letter, and shuts the door.]</i> Yes, it is from him. You shall not have it; I will read it myself.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002374": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002374",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002375": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002375",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, read it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002376": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002376",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002377": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002377",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[standing by the lamp]</i>. I scarcely have the courage to do it. It may mean ruin for both of us. No, I must know. <i>[Tears open the letter, runs his eye over a few lines, looks at a paper enclosed, and gives a shout of joy.]</i> Nora! <i>[She looks at him questioningly.]</i> Nora!—No, I must read it once again—. Yes, it is true! I am saved! Nora, I am saved!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002378": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002378",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002379": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002379",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd I?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002380": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002380",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002381": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002381",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou too, of course; we are both saved, both you and I. Look, he sends you your bond back. He says he regrets and repents—that a happy change in his life—never mind what he says! We are saved, Nora! No one can do anything to you. Oh, Nora, Nora!—no, first I must destroy these hateful things. Let me see—. <i>[Takes a look at the bond.]</i> No, no, I won’t look at it. The whole thing shall be nothing but a bad dream to me. <i>[Tears up the bond and both letters, throws them all into the stove, and watches them burn.]</i> There—now it doesn’t exist any longer. He says that since Christmas Eve you—. These must have been three dreadful days for you, Nora.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002382": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002382",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002383": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002383",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI have fought a hard fight these three days.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002384": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002384",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002385": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002385",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd suffered agonies, and seen no way out but—. No, we won’t call any of the horrors to mind. We will only shout with joy, and keep saying, “It’s all over! It’s all over!” Listen to me, Nora. You don’t seem to realise that it is all over. What is this?—such a cold, set face! My poor little Nora, I quite understand; you don’t feel as if you could believe that I have forgiven you. But it is true, Nora, I swear it; I have forgiven you everything. I know that what you did, you did out of love for me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002386": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002386",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002387": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002387",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThat is true.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002388": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002388",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002389": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002389",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou have loved me as a wife ought to love her husband. Only you had not sufficient knowledge to judge of the means you used. But do you suppose you are any the less dear to me, because you don’t understand how to act on your own responsibility? No, no; only lean on me; I will advise you and direct you. I should not be a man if this womanly helplessness did not just give you a double attractiveness in my eyes. You must not think anymore about the hard things I said in my first moment of consternation, when I thought everything was going to overwhelm me. I have forgiven you, Nora; I swear to you I have forgiven you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002390": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002390",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002391": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002391",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThank you for your forgiveness. <i>[She goes out through the door to the right.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002392": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002392",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002393": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002393",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNo, don’t go—. <i>[Looks in.]</i> What are you doing in there?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002394": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002394",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002395": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002395",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[from within]</i>. Taking off my fancy dress.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002396": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002396",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002397": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002397",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[standing at the open door]</i>. Yes, do. Try and calm yourself, and make your mind easy again, my frightened little singing-bird. Be at rest, and feel secure; I have broad wings to shelter you under. <i>[Walks up and down by the door.]</i> How warm and cosy our home is, Nora. Here is shelter for you; here I will protect you like a hunted dove that I have saved from a hawk’s claws; I will bring peace to your poor beating heart. It will come, little by little, Nora, believe me. Tomorrow morning you will look upon it all quite differently; soon everything will be just as it was before. Very soon you won’t need me to assure you that I have forgiven you; you will yourself feel the certainty that I have done so. Can you suppose I should ever think of such a thing as repudiating you, or even reproaching you? You have no idea what a true man’s heart is like, Nora. There is something so indescribably sweet and satisfying, to a man, in the knowledge that he has forgiven his wife—forgiven her freely, and with all his heart. It seems as if that had made her, as it were, doubly his own; he has given her a new life, so to speak; and she has in a way become both wife and child to him. So you shall be for me after this, my little scared, helpless darling. Have no anxiety about anything, Nora; only be frank and open with me, and I will serve as will and conscience both to you—. What is this? Not gone to bed? Have you changed your things?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002398": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002398",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002399": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002399",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[in everyday dress]</i>. Yes, Torvald, I have changed my things now.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002400": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002400",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002401": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002401",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut what for?—so late as this.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002402": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002402",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002403": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002403",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI shall not sleep tonight.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002404": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002404",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002405": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002405",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut, my dear Nora—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002406": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002406",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002407": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002407",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[looking at her watch]</i>. It is not so very late. Sit down here, Torvald. You and I have much to say to one another. <i>[She sits down at one side of the table.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002408": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002408",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002409": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002409",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora—what is this?—this cold, set face?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002410": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002410",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002411": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002411",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nSit down. It will take some time; I have a lot to talk over with you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002412": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002412",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002413": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002413",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[sits down at the opposite side of the table]</i>. You alarm me, Nora!—and I don’t understand you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002414": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002414",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002415": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002415",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, that is just it. You don’t understand me, and I have never understood you either—before tonight. No, you mustn’t interrupt me. You must simply listen to what I say. Torvald, this is a settling of accounts.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002416": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002416",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002417": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002417",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat do you mean by that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002418": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002418",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002419": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002419",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[after a short silence]</i>. Isn’t there one thing that strikes you as strange in our sitting here like this?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002420": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002420",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002421": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002421",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat is that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002422": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002422",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002423": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002423",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWe have been married now eight years. Does it not occur to you that this is the first time we two, you and I, husband and wife, have had a serious conversation?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002424": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002424",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002425": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002425",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat do you mean by serious?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002426": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002426",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002427": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002427",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIn all these eight years—longer than that—from the very beginning of our acquaintance, we have never exchanged a word on any serious subject.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002428": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002428",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002429": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002429",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWas it likely that I would be continually and forever telling you about worries that you could not help me to bear?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002430": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002430",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002431": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002431",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI am not speaking about business matters. I say that we have never sat down in earnest together to try and get at the bottom of anything.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002432": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002432",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002433": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002433",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut, dearest Nora, would it have been any good to you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002434": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002434",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002435": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002435",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThat is just it; you have never understood me. I have been greatly wronged, Torvald—first by papa and then by you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002436": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002436",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002437": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002437",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat! By us two—by us two, who have loved you better than anyone else in the world?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002438": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002438",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002439": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002439",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[shaking her head]</i>. You have never loved me. You have only thought it pleasant to be in love with me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002440": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002440",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002441": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002441",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora, what do I hear you saying?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002442": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002442",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002443": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002443",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt is perfectly true, Torvald. When I was at home with papa, he told me his opinion about everything, and so I had the same opinions; and if I differed from him I concealed the fact, because he would not have liked it. He called me his doll-child, and he played with me just as I used to play with my dolls. And when I came to live with you—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002444": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002444",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002445": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002445",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat sort of an expression is that to use about our marriage?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002446": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002446",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002447": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002447",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[undisturbed]</i>. I mean that I was simply transferred from papa’s hands into yours. You arranged everything according to your own taste, and so I got the same tastes as you—or else I pretended to, I am really not quite sure which—I think sometimes the one and sometimes the other. When I look back on it, it seems to me as if I had been living here like a poor woman—just from hand to mouth. I have existed merely to perform tricks for you, Torvald. But you would have it so. You and papa have committed a great sin against me. It is your fault that I have made nothing of my life.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002448": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002448",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002449": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002449",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nHow unreasonable and how ungrateful you are, Nora! Have you not been happy here?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002450": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002450",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002451": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002451",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, I have never been happy. I thought I was, but it has never really been so.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002452": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002452",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002453": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002453",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNot—not happy!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002454": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002454",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002455": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002455",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, only merry. And you have always been so kind to me. But our home has been nothing but a playroom. I have been your doll-wife, just as at home I was papa’s doll-child; and here the children have been my dolls. I thought it great fun when you played with me, just as they thought it great fun when I played with them. That is what our marriage has been, Torvald.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002456": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002456",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002457": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002457",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThere is some truth in what you say—exaggerated and strained as your view of it is. But for the future it shall be different. Playtime shall be over, and lesson-time shall begin.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002458": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002458",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002459": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002459",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhose lessons? Mine, or the children’s?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002460": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002460",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002461": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002461",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBoth yours and the children’s, my darling Nora.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002462": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002462",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002463": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002463",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAlas, Torvald, you are not the man to educate me into being a proper wife for you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002464": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002464",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002465": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002465",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd you can say that!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002466": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002466",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002467": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002467",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAnd I—how am I fitted to bring up the children?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002468": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002468",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002469": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002469",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002470": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002470",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002471": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002471",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDidn’t you say so yourself a little while ago—that you dare not trust me to bring them up?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002472": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002472",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002473": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002473",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nIn a moment of anger! Why do you pay any heed to that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002474": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002474",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002475": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002475",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIndeed, you were perfectly right. I am not fit for the task. There is another task I must undertake first. I must try and educate myself—you are not the man to help me in that. I must do that for myself. And that is why I am going to leave you now.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002476": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002476",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002477": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002477",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[springing up]</i>. What do you say?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002478": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002478",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002479": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002479",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI must stand quite alone, if I am to understand myself and everything about me. It is for that reason that I cannot remain with you any longer.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002480": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002480",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002481": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002481",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora, Nora!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002482": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002482",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002483": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002483",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI am going away from here now, at once. I am sure Christine will take me in for the night—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002484": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002484",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002485": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002485",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou are out of your mind! I won’t allow it! I forbid you!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002486": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002486",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002487": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002487",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt is no use forbidding me anything any longer. I will take with me what belongs to myself. I will take nothing from you, either now or later.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002488": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002488",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002489": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002489",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat sort of madness is this!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002490": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002490",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002491": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002491",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nTomorrow I shall go home—I mean, to my old home. It will be easiest for me to find something to do there.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002492": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002492",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002493": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002493",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou blind, foolish woman!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002494": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002494",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002495": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002495",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI must try and get some sense, Torvald.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002496": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002496",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002497": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002497",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nTo desert your home, your husband and your children! And you don’t consider what people will say!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002498": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002498",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002499": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002499",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI cannot consider that at all. I only know that it is necessary for me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002500": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002500",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002501": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002501",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nIt’s shocking. This is how you would neglect your most sacred duties.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002502": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002502",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002503": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002503",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat do you consider my most sacred duties?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002504": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002504",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002505": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002505",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nDo I need to tell you that? Are they not your duties to your husband and your children?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002506": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002506",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002507": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002507",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI have other duties just as sacred.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002508": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002508",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002509": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002509",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThat you have not. What duties could those be?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002510": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002510",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002511": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002511",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nDuties to myself.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002512": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002512",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002513": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002513",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBefore all else, you are a wife and a mother.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002514": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002514",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002515": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002515",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI don’t believe that any longer. I believe that before all else I am a reasonable human being, just as you are—or, at all events, that I must try and become one. I know quite well, Torvald, that most people would think you right, and that views of that kind are to be found in books; but I can no longer content myself with what most people say, or with what is found in books. I must think over things for myself and get to understand them.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002516": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002516",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002517": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002517",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nCan you not understand your place in your own home? Have you not a reliable guide in such matters as that?—have you no religion?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002518": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002518",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002519": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002519",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI am afraid, Torvald, I do not exactly know what religion is.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002520": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002520",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002521": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002521",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nWhat are you saying?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002522": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002522",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002523": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002523",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI know nothing but what the clergyman said, when I went to be confirmed. He told us that religion was this, and that, and the other. When I am away from all this, and am alone, I will look into that matter too. I will see if what the clergyman said is true, or at all events if it is true for me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002524": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002524",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002525": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002525",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThis is unheard of in a girl of your age! But if religion cannot lead you aright, let me try and awaken your conscience. I suppose you have some moral sense? Or—answer me—am I to think you have none?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002526": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002526",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002527": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002527",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI assure you, Torvald, that is not an easy question to answer. I really don’t know. The thing perplexes me altogether. I only know that you and I look at it in quite a different light. I am learning, too, that the law is quite another thing from what I supposed; but I find it impossible to convince myself that the law is right. According to it a woman has no right to spare her old dying father, or to save her husband’s life. I can’t believe that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002528": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002528",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002529": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002529",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou talk like a child. You don’t understand the conditions of the world in which you live.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002530": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002530",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002531": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002531",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, I don’t. But now I am going to try. I am going to see if I can make out who is right, the world or I.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002532": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002532",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002533": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002533",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou are ill, Nora; you are delirious; I almost think you are out of your mind.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002534": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002534",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002535": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002535",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI have never felt my mind so clear and certain as tonight.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002536": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002536",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002537": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002537",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd is it with a clear and certain mind that you forsake your husband and your children?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002538": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002538",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002539": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002539",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, it is.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002540": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002540",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002541": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002541",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThen there is only one possible explanation.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002542": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002542",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002543": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002543",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhat is that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002544": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002544",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002545": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002545",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYou do not love me anymore.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002546": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002546",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002547": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002547",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo, that is just it.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002548": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002548",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002549": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002549",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora!—and you can say that?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002550": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002550",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002551": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002551",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt gives me great pain, Torvald, for you have always been so kind to me, but I cannot help it. I do not love you any more.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002552": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002552",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002553": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002553",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[regaining his composure]</i>. Is that a clear and certain conviction too?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002554": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002554",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002555": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002555",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, absolutely clear and certain. That is the reason why I will not stay here any longer.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002556": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002556",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002557": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002557",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAnd can you tell me what I have done to forfeit your love?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002558": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002558",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002559": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002559",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYes, indeed I can. It was tonight, when the wonderful thing did not happen; then I saw you were not the man I had thought you were.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002560": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002560",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002561": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002561",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nExplain yourself better. I don’t understand you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002562": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002562",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002563": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002563",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI have waited so patiently for eight years; for, goodness knows, I knew very well that wonderful things don’t happen every day. Then this horrible misfortune came upon me; and then I felt quite certain that the wonderful thing was going to happen at last. When Krogstad’s letter was lying out there, never for a moment did I imagine that you would consent to accept this man’s conditions. I was so absolutely certain that you would say to him: Publish the thing to the whole world. And when that was done—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002564": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002564",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002565": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002565",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nYes, what then?—when I had exposed my wife to shame and disgrace?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002566": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002566",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002567": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002567",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nWhen that was done, I was so absolutely certain, you would come forward and take everything upon yourself, and say: I am the guilty one.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002568": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002568",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002569": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002569",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora—!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002570": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002570",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002571": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002571",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nYou mean that I would never have accepted such a sacrifice on your part? No, of course not. But what would my assurances have been worth against yours? That was the wonderful thing which I hoped for and feared; and it was to prevent that, that I wanted to kill myself.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002572": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002572",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002573": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002573",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nI would gladly work night and day for you, Nora—bear sorrow and want for your sake. But no man would sacrifice his honour for the one he loves.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002574": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002574",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002575": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002575",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nIt is a thing hundreds of thousands of women have done.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002576": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002576",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002577": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002577",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nOh, you think and talk like a heedless child.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002578": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002578",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002579": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002579",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nMaybe. But you neither think nor talk like the man I could bind myself to. As soon as your fear was over—and it was not fear for what threatened me, but for what might happen to you—when the whole thing was past, as far as you were concerned it was exactly as if nothing at all had happened. Exactly as before, I was your little skylark, your doll, which you would in future treat with doubly gentle care, because it was so brittle and fragile. <i>[Getting up.]</i> Torvald—it was then it dawned upon me that for eight years I had been living here with a strange man, and had borne him three children—. Oh, I can’t bear to think of it! I could tear myself into little bits!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002580": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002580",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002581": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002581",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[sadly]</i>. I see, I see. An abyss has opened between us—there is no denying it. But, Nora, would it not be possible to fill it up?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002582": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002582",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002583": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002583",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nAs I am now, I am no wife for you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002584": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002584",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002585": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002585",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nI have it in me to become a different man.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002586": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002586",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002587": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002587",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nPerhaps—if your doll is taken away from you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002588": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002588",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002589": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002589",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut to part!—to part from you! No, no, Nora, I can’t understand that idea.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002590": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002590",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002591": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002591",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[going out to the right]</i>. That makes it all the more certain that it must be done. <i>[She comes back with her cloak and hat and a small bag which she puts on a chair by the table.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002592": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002592",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002593": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002593",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora, Nora, not now! Wait until tomorrow.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002594": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002594",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002595": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002595",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[putting on her cloak]</i>. I cannot spend the night in a strange man’s room.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002596": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002596",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002597": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002597",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut can’t we live here like brother and sister—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002598": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002598",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002599": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002599",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[putting on her hat]</i>. You know very well that would not last long. <i>[Puts the shawl round her.]</i> Goodbye, Torvald. I won’t see the little ones. I know they are in better hands than mine. As I am now, I can be of no use to them.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002600": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002600",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002601": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002601",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut some day, Nora—some day?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002602": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002602",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002603": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002603",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nHow can I tell? I have no idea what is going to become of me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002604": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002604",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002605": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002605",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut you are my wife, whatever becomes of you.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002606": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002606",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002607": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002607",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nListen, Torvald. I have heard that when a wife deserts her husband’s house, as I am doing now, he is legally freed from all obligations towards her. In any case, I set you free from all your obligations. You are not to feel yourself bound in the slightest way, any more than I shall. There must be perfect freedom on both sides. See, here is your ring back. Give me mine.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002608": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002608",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002609": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002609",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nThat too?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002610": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002610",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002611": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002611",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThat too.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002612": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002612",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002613": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002613",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nHere it is.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002614": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002614",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002615": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002615",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThat’s right. Now it is all over. I have put the keys here. The maids know all about everything in the house—better than I do. Tomorrow, after I have left her, Christine will come here and pack up my own things that I brought with me from home. I will have them sent after me.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002616": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002616",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002617": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002617",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nAll over! All over!—Nora, shall you never think of me again?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002618": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002618",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002619": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002619",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nI know I shall often think of you, the children, and this house.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002620": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002620",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002621": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002621",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nMay I write to you, Nora?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002622": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002622",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002623": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002623",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo—never. You must not do that.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002624": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002624",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002625": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002625",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut at least let me send you—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002626": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002626",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002627": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002627",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNothing—nothing—</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002628": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002628",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002629": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002629",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nLet me help you if you are in want.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002630": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002630",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002631": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002631",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nNo. I can receive nothing from a stranger.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002632": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002632",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002633": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002633",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nNora—can I never be anything more than a stranger to you?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002634": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002634",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002635": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002635",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\n<i>[taking her bag]</i>. Ah, Torvald, the most wonderful thing of all would have to happen.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002636": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002636",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002637": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002637",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nTell me what that would be!</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002638": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002638",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002639": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002639",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nBoth you and I would have to be so changed that—. Oh, Torvald, I don’t believe any longer in wonderful things happening.</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002640": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002640",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002641": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002641",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\nBut I will believe in it. Tell me! So changed that—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002642": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002642",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002643": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002643",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">NORA.<br>\nThat our life together would be a real wedlock. Goodbye. <i>[She goes out through the hall.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002644": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002644",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002645": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002645",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p class=\"drama\">HELMER.<br>\n<i>[sinks down on a chair at the door and buries his face in his hands]</i>. Nora! Nora! <i>[Looks round, and rises.]</i> Empty. She is gone. <i>[A hope flashes across his mind.]</i> The most wonderful thing of all—?</p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002646": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002646",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002647": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002647",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-94ae074fcdaa7fab-2a5ce7 twpub-94ae074fcdaa7fab-1edddd twpub-94ae074fcdaa7fab-6b4cd0\"><div class=\"chapter\"><p><i>[The sound of a door shutting is heard from below.]</i></p></div></div>"
        },
        "$:/plugins/twpub/94ae074fcdaa7fab/text/000002648": {
            "role": "text",
            "title": "$:/plugins/twpub/94ae074fcdaa7fab/text/000002648",
